INSERT INTO `collezione` (`id`, `nome`, `descrizione`, `copertina`) VALUES
(10, 'Star Wars - Collezione', 'Star Wars è un franchise colossal di fantascienza creato da George Lucas, che si sviluppa da una saga cinematografica iniziata nel 1977 col film Guerre stellari e sottotitolato retroattivamente Episodio IV - Una nuova speranza. A questo film sono seguiti L\'Impero colpisce ancora (1980) e Il ritorno dello Jedi (1983)che insieme formano la \"trilogia originale\" alla quale seguì dal 2002 una trilogia prequel, e una trilogia sequel dal 2015.', '/lBdOIyD5rOJA34qiDi3yrZqdbg7.jpg'),
(119, 'Il Signore degli Anelli - Collezione', 'Il Signore degli Anelli (in inglese The Lord of the Rings) è una trilogia colossal fantasy co-prodotta, co-scritta e diretta del regista neozelandese Peter Jackson, basata sull\'omonimo romanzo scritto da J. R. R. Tolkien. La saga è formata da Il Signore degli Anelli - La Compagnia dell\'Anello (2001), Il Signore degli Anelli - Le due torri (2002) e Il Signore degli Anelli - Il ritorno del re (2003).', '/lTVIlPNfhVBZvXU31xHea6Sm7zO.jpg'),
(230, 'Il padrino - Collezione', 'Trilogia di Francis Ford Coppola sulla vita quotidiana di una famiglia mafiosa di New York . Con il suo cast stellare questi film sono passati alla storia come alcuni dei più grandi capolavori che Hollywood abbia mai prodotto.', '/asbHC0dhjmmEJFfKzeZ5I6kxZnM.jpg'),
(263, 'Batman - Il cavaliere oscuro - Collezione', 'La trilogia del cavaliere oscuro con protagonista Batman è composta da tre film. In \"Batman Begins\" Bruce Wayne intraprende un addestramento fisico e psicologico per diventare Batman. Ne \"Il cavaliere oscuro\" Batman affronta il suo nemico di sempre, Il Joker. Ne \"Il cavaliere oscuro - Il ritorno\" invece si trova faccia a faccia con Bane', '/hGvOMQBD88jAV0olS2DT1AxreHn.jpg'),
(264, 'Ritorno al futuro - Collezione', 'La trilogia di Ritorno al futuro narra delle peripezie a cavallo di varie epoche della storia statunitense (il 1955, il 1985, il 2015 e il 1885) affrontate dal giovane Marty McFly (Michael J. Fox) e dal suo amico, lo stravagante scienziato Emmett \"Doc\" Brown (Christopher Lloyd), inventore di una bizzarra macchina del tempo ricavata da una DeLorean DMC-12. Nel corso dei tre episodi i due si trovano a risolvere diversi problemi per evitare catastrofici paradossi temporali.', '/8sqpH7lGZuvima0PUZLCh7slLXD.jpg'),
(528, 'Terminator - Collezione', 'I Terminator sono cyborg, androidi o semplici robot, ideati dall\'intelligenza artificiale Skynet, un supercomputer che acquista autocoscienza e si pone come obiettivo la distruzione del genere umano usando le stesse armi create dall\'uomo per la propria difesa. Per annientare il leader della resistenza umana, skynet manda indietro nel tempo dei Terminator con lo scopo di eliminarlo cambiando il corso della storia.', '/kpZxdNsAV7qTdTLwKM5NLqa7GEo.jpg'),
(1241, 'Harry Potter - Collezione', 'La serie di film di Harry Potter è una serie di film basati sui romanzi di Harry Potter di J.K. Rowling. La serie è distribuita dalla Warner Bros. e si compone di otto film fantasy a partire da Harry Potter e la Pietra Filosofale (2001) e concludendosi con Harry Potter e i Doni della Morte - Parte 2 (2011)', '/xlaQ4yD2g97TmN2iVaWUdmpwJk7.jpg'),
(2344, 'Matrix - Collezione', 'Esistono due realtà: una è l\'esistenza che conduciamo ogni giorno, l\'altra è nascosta. Thomas Anderson, programmatore di software e hacker con lo pseudonimo di \"Neo\", viene contattato da Morpheus che lo aiuta a scoprire che la realtà in cui vive non è altro che il Matrix, un mondo virtuale elaborato al computer creato per tenere sotto controllo le persone.', '/bV9qTVHTVf0gkW0j7p7M0ILD4pG.jpg'),
(4438, 'Odissea nello spazio - Collezione', 'La serie Space Odyssey è una serie di fantascienza composta da due adattamenti cinematografici tratti dalle opere di Arthur C. Clarke. \'2001: Odissea nello spazio\' - un film e un romanzo - prodotti contemporaneamente e pubblicati nel 1968 e \'2010: L\'anno del contatto\', un adattamento di Peter Hyams.', '/5YWqk2QqZx4OuSi29Sg7EuAwuZf.jpg'),
(8091, 'Alien - Collezione', 'La saga di Alien è ambientata tra il ventunesimo e ventiquattresimo secolo. La protagonista Ellen Ripley è coinvolta in uno scontro con l\'azienda immaginaria Weyland-Yutani, che intende trasportare esemplari d\'una razza aliena ostile detta Xenomorfo sulla Terra. La serie prequel segue gli intrighi dell\'androide David 8, e mostra la genesi dell\'umanità grazie agli Ingegneri e l\'origine degli Xenomorfi.', '/vsCjNAyoF0POaGG0dRcQVQYtoZu.jpg'),
(9743, 'Hannibal Lecter - Collezione', 'Hannibal Lecter è una serie di film thriller psicologici americani, adattati dal romanzo di Thomas Harris con lo stesso nome. Hannibal è un sequel del film vincitore del 1991 Oscar® The Silence of the Lambs che restituisce Anthony Hopkins al suo iconico ruolo di serial killer Hannibal Lecter. Julianne Moore è coprotagonista, subentrando a Jodie Foster nel ruolo dell\'agente dell\'FBI Clarice Starling. Il prequel di Red Dragon vede Edward Norton nel ruolo dell\'agente dell\'FBI Will Graham. Original Manhunter e Hannibal Rising sans Hopkins.', '/7xjVZRMS2GXq5ypKr8wX2ZpAX38.jpg'),
(86311, 'Avengers - Collezione', 'Avengers è una serie di film di supereroi prodotta da Marvel Studios basata sull\'omonimo team di supereroi Marvel Comics e parte del Marvel Cinematic Universe (MCU). La serie racconta le avventure di diversi supereroi che uniscono le forze per mantenere la pace nel mondo guidati da Nick Fury dell\'agenzia di intelligence internazionale S.H.I.E.L.D.', '/onIXErRZAtccMLPKxhFPRhxY6gu.jpg'),
(94032, 'Il re leone - Collezione', '', '/1tip3TnNcSPUEPkitpwsbdyWfod.jpg'),
(119674, 'Psycho - Collezione', '', '/2cFhmOImIv5VPbc2ieLRPCFacAh.jpg'),
(479888, 'La Cosa - Collezione', 'E\' già dura e difficile la vita di un gruppo di 12 scienziati in una base americana dell\'Alaska. A renderla del tutto impossibile arriva all\'improvviso la \"cosa\", una sostanza vivente che le radiazioni atomiche hanno dissepolto dopo millenni di silenzio sotto i ghiacci eterni dell\'Artide. La \"cosa\" tenta di aggredire animali ed esseri umani e di assumere di volta in volta le loro sembianze. Ben presto mostruose apparizioni e orrende morti convincono gli ospiti della base che tra di loro c\'è un contagiato dalla \"cosa\". Comincia così un gioco di massacro fatto di sospetti, di diffidenze, di vendette.', '/kFDZrotAIzNoelHZVYbDjVnlOeO.jpg'),
(530064, 'Shining - Collezione', '', '/oeuzvbyE1bCsNUndKv1acHbmtmg.jpg'),
(531241, 'Spider-Man (Avengers) - Collezione', 'Nuovo reboot di spider-man ambientato nell universo MCU.\r I Marvel Studios e Sony hanno annunciato un accordo per condividere i film Spider-Man, portando ad una interazione di Spider-Man con i personaggi Marvel nell\'MCU.  Tom Holland interpreta questa versione più giovane di Spider-Man, che appare in Captain America: Civil War (2016), Spider-Man: Homecoming (2017), Avengers: Infinity War (2018), Avengers: Endgame (2019) e Spider-Man: Homecoming(2019). I film di questo universo con spider-man protgonista sono Spider-Man: Homecoming del 2017 e Spider-Man: Far from Home del 2019.', '/plxMngMDZ3r2OSPn84UlyNHkmwi.jpg'),
(531330, 'Top Gun - Collezione', 'Serie cinematografica basata sul personaggio del tenente Pete \"Maverick\" Mitchell, aviatore della Marina statunitense.', '/zHnCrJ6XJlQWrvETaT7D0SnKu15.jpg'),
(544670, 'Sing - Collezione', '', '/h151oRzvsxfKRznEmlQJRlnvsid.jpg'),
(573436, 'Spider-Man: Un nuovo universo - Collezione', '', '/eD4bGQNfmqExIAzKdvX5gDHhI2.jpg'),
(837007, 'Crudelia - Collezione', '', '/lXiLDlf1AKOY6i0eOZ7gi7zLH2O.jpg'),
(925155, 'Demon Slayer: Kimetsu no Yaiba - Collection', '', '/q8wplgnax24RuOlUnDBT0hIZ2tr.jpg'),
