INSERT INTO `film` (`id`, `titolo`, `titolo_originale`, `durata`, `copertina`, `descrizione`, `data_rilascio`, `stato`, `budget`, `incassi`, `collezione`, `voto`) VALUES
(11, 'Guerre stellari', 'Star Wars', 121, '/fVqKwpvobwWy0P1UImZWIDuw4RI.jpg', 'In un lontano Impero Galattico è in atto una rivolta contro i suoi dispotici capi, tra i quali il più cattivo è Lord Darth Vader. Prima di cadere nelle sue mani, la principessa Leila Organa, rappresentante dei ribelli, riesce ad affidare a due robot i piani della \"Morte Nera\" - la potentissima base spaziale di Darth Vader, capace di disintegrare un intero pianeta - e un appello al vecchio generale Obi-Wan Kenobi, che abita sul pianeta Tatooine, perché accorra in aiuto dei rivoltosi. Il messaggio viene raccolto dal giovane Luke Skywalker che, rintracciato Obi Wan Kenobi, parte con lui in soccorso della principessa a bordo di un\'astronave guidata dal mercenario Han Solo e dal suo secondo Chewbacca.', '1977-05-25', 'Released', 11000000, 775398007, 10, NULL),
(13, 'Forrest Gump', 'Forrest Gump', 137, '/pGZqc9jQ6F8klQZKm37NAAMH70o.jpg', 'Forrest Gump - un ragazzo non proprio idiota, ma dal basso coefficiente d\'intelligenza - racconta la sua storia a coloro che, uno dopo l\'altro, si siedono vicino a lui in attesa dell\'autobus. È stato in Vietnam, ha stretto la mano a tre presidenti, ha incontrato Elvis, ha assistito ai movimenti studenteschi, ha casualmente fatto esplodere il Watergate, ha suggerito le parole di \"Imagine\" a John Lennon e per tutta la vita è stato innamorato di una ragazza conosciuta fin da bambino.', '1994-06-23', 'Released', 55000000, 677387716, NULL, NULL),
(14, 'American Beauty', 'American Beauty', 117, '/l3vVtb8jE1OG12c6RTuoomsXl2F.jpg', 'Lester e Carolyn Burnham appaiono dall\'esterno una coppia perfetta, con una casa perfetta e un vicinato perfetto. In realtà Lester è un uomo, insoddisfatto della sua vita familiare e professionale, che sta cadendo in una sempre più profonda disperazione, quando improvvisamente conosce Angela, un\'amica di sua figlia e se ne infatua. Nel frattempo Jane, la figlia di Lester ha conosciuto il loro timido e misterioso vicino di casa Ricky che vive oppresso da una figura paterna ossessiva.', '1999-09-15', 'Released', 15000000, 356296601, NULL, NULL),
(15, 'Quarto potere', 'Citizen Kane', 119, '/zUBk9AkR1aiTfAMIdL5xpbA6AQY.jpg', 'Alla morte del magnate Kane (Welles), un giornalista (Cotten) indaga sulla sua vita: dalla sua infanzia alla sua ascesa nel mondo della stampa e della finanza, alla sua storia d\'amore con una cantante lirica mancata alla solitaria fine nella lussuosa e sconfinata tenuta di Xanadu.', '1941-04-17', 'Released', 839727, 23218000, NULL, NULL),
(28, 'Apocalypse Now', 'Apocalypse Now', 150, '/oDQGZrV2wasxHhHsfhAnCkqpfqa.jpg', 'A Saigon, durante la guerra in Vietnam il capitano dei corpi speciali Benjamin Willard riceve dai superiori l\'ordine di trovare ed eliminare il colonnello Walter Kurtz che uscito con i suoi soldati dai ranghi dell\'esercito americano, sta combattendo una guerra personale ai confini fra il Vietnam e la Cambogia. Scortato da alcuni uomini, Willard risale un fiume a caccia del colonnello. Dopo varie peripezie il capitano individua Kurtz all\'interno di una sorta di reggia-tempio protetta dalla vegetazione e da numerosi indigeni armati. Willard non sa che fare, ma è lo stesso Kurtz che lo induce ad eseguire la condanna.', '1979-08-15', 'Released', 31500000, 150000000, NULL, NULL),
(38, 'Se mi lasci ti cancello', 'Eternal Sunshine of the Spotless Mind', 108, '/chUdF3vUfjdz4sdsMFd8ejgt52f.jpg', 'Joel e Clementine sono una coppia molto innamorata. Un giorno però, la ragazza, stanca della sua relazione ormai in fase di declino, decide, mediante un esperimento scientifico, di farsi asportare dalla mente la parte relativa alla storia con Joel. Il giovane, una volta venuto a conoscenza di questo fatto, sceglie di fare altrettanto ma durante il procedimento cambia idea.', '2004-03-19', 'Released', 20000000, 72258126, NULL, NULL),
(62, '2001: Odissea nello spazio', '2001: A Space Odyssey', 141, '/b5UQwYxeKoutvbtp3eLkY5iilJX.jpg', 'Un gigantesco monolite, individuato sulla superficie lunare, trasmette dei messaggi radio in direzione del pianeta Giove. Per seguire il fascio di onde elettromagnetiche viene organizzata una spedizione che ben presto però si trova in balia del computer che governa l\'astronave. La lotta avrà un solo vincitore.', '1968-04-02', 'Released', 12000000, 71923560, 4438, NULL),
(73, 'American History X', 'American History X', 119, '/c2gsmSQ2Cqv8zosqKOCwRS0GFBS.jpg', 'In un tema in classe il giovane Danny tratta argomenti ispirati al \'Mein Kampf\' e il preside Sweeney, per punirlo, lo obbliga a preparare una relazione sul fratello maggiore Derek. Quest\'ultimo, ex leader di un gruppo giovanile paranazista che si riconosceva in Cameron, ideologo della violenza razzista contro ogni forma di diversità, è appena uscito dal carcere dopo aver scontato alcuni anni per l\'uccisione di due ragazzi neri che gli stavano rubando l\'automobile. Danny aspetta da tempo questo momento. Ha immaginato molte volte la scarcerazione di Derek e non desidera altro che mettersi ai \'suoi ordini\'. Non sa che in carcere Derek ha riflettuto molto maturando la convinzione di voler cambiare vita. Danny si sente spaesato, soprattutto quando, durante una festa vede Derek avere uno scontro violento con Cameron, ma poi riesce a capire le ragioni di suo fratello. L\'odio, però, a volte genera una serie di violenze difficili da fermare.', '1998-07-01', 'Released', 20000000, 23875127, NULL, NULL),
(77, 'Memento', 'Memento', 113, '/dCCsDcMeJFVOUN0mt9QYGHZDquq.jpg', 'Memento è l\'imperativo del verbo difettivo latino \"memini, isse\" e può essere tradotto con \"ricordati\", che è la parola chiave del secondo lungometraggio di Christopher Nolan. Intorno a questo principio ruota infatti l\'intera vicenda, non raccontata in modo lineare, ma attraverso un apparente caos che incarna il punto di vista del personaggio principale, Leonard Shelby, affetto da una particolare forma di amnesia, che lascia intatti i vecchi ricordi ma comporta la perdita della memoria breve. Attraverso un\'affannosa ricerca compiuta per mezzo dell\'azione e della scrittura, che serve a registrare ciò di cui la percezione non può farsi sicuro garante, il detective Shelby cerca l\'assassino della moglie, l\'ultimo ricordo che \"non riesce a ricordare di dimenticare\", in una labirintica realtà continuamente riazzerata e in cui non si può mai pronunciare l\'ultima parola.', '2000-10-11', 'Released', 9000000, 39723096, NULL, NULL),
(98, 'Il gladiatore', 'Gladiator', 155, '/42KK5H6oo30LxQ9PtYoUklPltrM.jpg', 'Dopo una vittoria contro i Britanni l\'imperatore Marco Aurelio (Harris), che disprezza il figlio Commodo (Phoenix), decide che il suo successore sarà il generale Massimo (Crowe), uomo straordinario, amato da tutti. Ma Commodo uccide il padre e ordina la morte del generale e della sua famiglia. Massimo fugge in Africa, diventa gladiatore, torna a Roma dove si fa riconoscere. Diventa l\'eroe del Colosseo, idolatrato dal popolo. Tanto che lo stesso Commodo non può farlo uccidere. Lo sfida a un duello nell\'arena, dopo averlo vigliaccamente ferito. Massimo uccide finalmente l\'orrendo imperatore.', '2000-05-04', 'Released', 103000000, 465361176, NULL, NULL),
(100, 'Lock & Stock - Pazzi scatenati', 'Lock, Stock and Two Smoking Barrels', 107, '/b2U6RVPmbQQVAajHwtmTwUBuF22.jpg', 'Quattro ragazzi tentano la fortuna nel gioco d\'azzardo ma si ritorvano fortmente indebitati con un boss locale. Disperati, decidono di derubare dei coltivatori di erba, ma le cose non andranno nel modo stabilito.', '1998-08-28', 'Released', 1350000, 28356188, NULL, NULL),
(101, 'Léon', 'Léon: The Professional', 110, '/wcIFHPgRNPY5h72psFPkf9CHOf9.jpg', 'Léon è un killer che vive solo, avendo unicamente una pianta da vaso come compagnia. Mathilda è una ragazzina che abita nell\'appartamento a fianco alla stanza di Léon. Quando la famiglia di Mathilda viene sterminata per una storia di droga, lei chiede aiuto a Léon. Tra i due nasce una tenera amicizia, fra scambi di lezioni sull\'uso delle armi da una parte e di lettura dall\'altra.', '1994-09-14', 'Released', 16000000, 45284974, NULL, NULL),
(103, 'Taxi Driver', 'Taxi Driver', 113, '/8BSD2Zo9E3yzsTjF7wYMrGObwGR.jpg', 'New York: Travis Bickle, veterano del Vietnam in congedo, soffre d\'insonnia e decide di impegnare le proprie notti facendo il tassista. Completamente disadattato ma idealista alla ricerca di uno scopo, l\'uomo si invaghirà di una ragazza e le chiederà di uscire. Quando le cose tra i due andranno storte, Travis, definitivamente disilluso riguardo la società, si chiuderà in se stesso. Comincerà così per il tassista una claustrofobica discesa nel baratro della solitudine, in bilico sui margini della sanità mentale.', '1976-02-09', 'Released', 1300000, 28570902, NULL, NULL),
(105, 'Ritorno al futuro', 'Back to the Future', 116, '/AkmUoSHkxW9txpzZ52gCcWweEkE.jpg', 'Marty McFly è stato catapultato per errore nel 1955, grazie alla macchina del tempo ideata dal suo amico scienziato Doc. Non avendo più \"carburante\" per poter tornare nel futuro si rivolge alla versione più giovane di Doc, che nonostante l\'incredulità iniziale si farà in quattro per aiutarlo. Ma nel 1955 non è solo Doc ad essere più giovane, Marty infatti si imbatte casualmente nei suoi genitori, all\'epoca teenager, ma l\'incontro aggiungerà altri problemi.', '1985-07-03', 'Released', 19000000, 381109762, 264, NULL),
(111, 'Scarface', 'Scarface', 170, '/A1gaGQ58crIW3lXzFxOKIryAt7Y.jpg', 'Ambientato nella Miami degli anni 80, l\'intreccio si dipana tra il mondo degli immigrati cubani e quello dei signori della droga della east-coast. Tony Montana, lo sfregiato, è uno tra i tanti \"rifugiati politici\" in territorio statunitense, sbarcati sulle coste della Florida in seguito all\'apertura delle carceri cubane. Per i profughi la via più veloce per abbandonare la degenza economica è darsi al crimine, e Tony, non certo uno stinco di santo, non ci penserà due volte. Comincerà così per il gangster una rapida ascesa, che arriverà a vertiginose quanto pericolose altezze.', '1983-12-09', 'Released', 25000000, 66023329, NULL, NULL),
(120, 'Il Signore degli Anelli - La compagnia dell\'anello', 'The Lord of the Rings: The Fellowship of the Ring', 179, '/xvjOBWfm32skiwIAU2iocb6fyC8.jpg', 'Bilbo Baggins ha deciso di celebrare il suo centoundicesimo compleanno in maniera molto particolare;alla fine della festa, abbandona parenti, amici, conoscenti e il suo affezionato nipote Frodo, cui lascia ogni cosa. Lo stregone Gandalf insiste perché lo hobbit lasci a Frodo anche il suo anello magico, su cui intende tenere un occhio vigile e fare alcune ricerche, perché potrebbe celare un mistero più inquietante di quanto non sembri. E così è; quello di Bilbo è l\'Unico Anello, l\'Anello per domarli, il cuore del potere del malefico Signore Oscuro Sauron, che sta tornando a tessere le sue trame di conquista e distruzione. Per impedirgli di vedere realizzato il suo sanguinoso disegno, l\'anello dovrà essere distrutto, cosa possibile soltanto nella fornace di Monte Fato, dove Sauron, secoli prima, lo forgiò.', '2001-12-18', 'Released', 93000000, 871368364, 119, NULL),
(121, 'Il Signore degli Anelli - Le due torri', 'The Lord of the Rings: The Two Towers', 180, '/fVKewiBPcY2dQujYEsnQmQ7lfRZ.jpg', 'La Compagnia dell\'Anello è divisa, e ogni speranza è riposta ora in Frodo e Sam, che stanno tentando di attraversare non visti i confini di Mordor, tallonati dall\'infido Gollum: Aragorn, Gimli e Legolas sono invece sulle tracce di Merry e Pipino, rapiti dagli Uruk-Hai di Saruman e in grave pericolo di vita. Attraverso alterne vicende, raggiungeranno la terra di Rohan e aiuteranno il Re Theoden nella sua guerra contro il traditore Saruman...', '2002-12-18', 'Released', 79000000, 926287400, 119, NULL),
(122, 'Il Signore degli Anelli - Il ritorno del re', 'The Lord of the Rings: The Return of the King', 201, '/96XilLzI7bijsCG4l7oW6I62oad.jpg', 'Le forze di Sauron hanno attaccato la capitale di Gondor, Minas Tirith, nel suo assedio finale contro l\'umanità. Tenuto da un debole sovrintendente, quello che una volta era un fastoso regno non ha mai avuto così bisogno del proprio re. Mentre Gandalf tenta disperatamente di spingere lo smembrato esercito di Gondor ad agire, Thèoden si unisce ai guerrieri di Rohan per combattere assieme a loro. Pieno di coraggio e di appassionata lealtà, l\'esercito degli umani non riesce però a tener testa alle numerosissime legioni nemiche che giungono su tutto il regno. Ogni vittoria è accompagnata da un grande sacrificio. Malgrado le numerose perdite, la Compagnia si lancia verso la più grande battaglia mai affrontata, unita dall\'unico scopo di riuscire a tenere Sauron distratto e dare a Frodo una occasione per portare a termine la sua spedizione...', '2003-12-01', 'Released', 94000000, 1118888979, 119, NULL),
(128, 'Principessa Mononoke', 'もののけ姫', 134, '/87Cmf9hfPGPmqVO05pXWBdU9Ewp.jpg', 'In seguito allo scontro con un animale posseduto da un demone il principe Ashitaka viene contaminato da una maledizione mortale. Si mette dunque in viaggio per scoprirne l\'origine e chiedere una cura al grande Dio Bestia, l\'unico in grado di guarirlo. Arrivato nelle regioni da cui proveniva la bestia scopre una guerra tra uomini e una forma primitiva di animali della foresta, giganti, senzienti e aiutati da quella che chiamano la Principessa Spettro, una ragazza cresciuta dai lupi che ha rinnegato gli uomini. Dall\'altra parte gli uomini, capitanati da Lady Eboshi che gestisce con amore, giustizia e pietà il suo villaggio di fabbri, vogliono lavorare la montagna e abbattere gli alberi per poter estrarre il ferro (fonte di ricchezza). In mezzo un gruppo di monaci cerca di fomentare gli uomini ad uccidere il Dio Bestia e rubarne la testa perchè, si dice, fornisca l\'eterna giovinezza.', '1997-07-12', 'Released', 26500000, 159414369, NULL, NULL),
(129, 'La città incantata', '千と千尋の神隠し', 125, '/3PV6lq9BNmoyyDXr5tdNeeESEMn.jpg', 'La piccola Chihiro non sopporta l\'idea di traslocare e di perdere i propri amici, ma non può far niente per impedirlo. Proprio quando la famiglia è in viaggio verso la nuova casa, il padre imbocca una strada sterrata che termina davanti a un tunnel misterioso. I genitori sceglieranno di attraversarlo nonostante le rimostranze di Chihiro, per giungere a un parco dei divertimenti abbandonato, almeno apparentemente.', '2001-07-20', 'Released', 19000000, 274925095, NULL, NULL),
(155, 'Il cavaliere oscuro', 'The Dark Knight', 146, '/qIhsgno1mjbzUbs4H6DaRjhskAR.jpg', 'Il crimine organizzato a Gotham City ha le ore contate. Batman, il tenente Gordon, il nuovo Procuratore Distrettuale e alcuni improbabili epigoni dell\'Uomo Pipistrello in imbottiture da hockey hanno dichiarato guerra ai criminali. La loro fortuna e i loro dollari, accumulati in una banca di massima sicurezza, vengono rubati da Joker, un pagliaccio sadico e mascherato che getterà la città nel disordine e nell\'anarchia. Riempite le tasche di lame, polvere da sparo e lanugine, Joker sfiderà il cavaliere oscuro di Bruce Wayne e rivelerà il lato oscuro di Harvey Dent, l\'eroe procuratore che applica la giustizia e agisce a volto scoperto.', '2008-07-14', 'Released', 185000000, 1004558444, 263, NULL),
(165, 'Ritorno al futuro - Parte II', 'Back to the Future Part II', 108, '/y86WZGmsiKHZ0HmH1NZRx2iOaP4.jpg', 'Il film comincia dove terminava il primo capitolo, ovvero con Marty e Jennifer che partono insieme allo scienziato Doc, inventore della macchina del tempo, per il 2015 allo scopo di evitare che il futuro dei loro figli possa essere in pericolo. Ma la situazione precipita e ad essere in pericolo non è più il futuro, ma il passato. Marty dovrà tornare nuovamente nel 1955 e...', '1989-11-22', 'Released', 40000000, 332000000, 264, NULL),
(185, 'Arancia meccanica', 'A Clockwork Orange', 137, '/LVnyZ3gmeH9eY1qxFvfkNaJHSi.jpg', 'Alex è un giovane senza arte né parte, figlio di proletari e dedito a furti, stupri e omicidi. Fa capo a una banda di spostati, denominati drughi. Dopo aver usato violenza alla moglie di uno scrittore finisce in carcere. Viene sottoposto ad angherie ma si fa amico un prete. Pur di essere scarcerato accetta il \"trattamento lodovico\", che consiste nell\'assistere a filmati di violenza. Quando esce scopre che i genitori hanno subaffittato la sua stanza. Senza poter reagire, dovrà subire violenza da alcuni mendicanti vendicativi, dai drughi diventati poliziotti e dallo scrittore che ha perso la moglie e che ora si trova su una sedia a rotelle. Tenta il suicidio e all\'ospedale riceve una visita di cortesia da parte del primo ministro.', '1971-12-19', 'Released', 2200000, 26589000, NULL, NULL),
(196, 'Ritorno al futuro - Parte III', 'Back to the Future Part III', 118, '/fR29F37jN4y1xapDAcjI9CEgM65.jpg', 'Per questa terza, conclusiva, puntata della trilogia, Marty McFly è costretto a tornare indietro nel tempo fino al 1885 per salvare Doc, che vi era stato catapultato al termine del secondo capitolo. Questa volta tornare nel futuro sarà ancora più difficile.', '1990-05-25', 'Released', 40000000, 244527583, 264, NULL),
(207, 'L\'attimo fuggente', 'Dead Poets Society', 130, '/nIH9ZI4aA8zd0tQSduMWtpniyyH.jpg', 'Stato del Vermont (Stati Uniti), 1959: nel college maschile Welton, molto tradizionale, viene trasferito il professore John Keating, un insegnante di lettere simpatico e anticonformista. Fin dal primo contatto con i giovani allievi, traspare non solo il suo diverso modo d\'insegnamento ma anche il suo approccio che esorta i ragazzi ad affrontare lo studio e la vita seguendo le proprie idee e non quelle dei nonni. Uno degli studenti, entrato in conflitto con i suoi genitori, si suiciderà. La responsabilità viene rifilata al professore. Lui sarà cacciato, ma i suoi allievi non lo dimenticheranno.', '1989-06-02', 'Released', 16400000, 235860116, NULL, NULL),
(218, 'Terminator', 'The Terminator', 108, '/kdYu7YJJP0uuGEuhUX5toqvBSog.jpg', 'Anno 2029: un computer chiamato Skynet sta lottando contro un gruppo di resistenza umana, dopo aver distrutto l\'umanità nel 1997. Skynet manda nel passato uno dei suoi guerrieri, un cyborg di sembianze umane chiamato Terminator, per uccidere Sarah Connor, la madre del leader della resistenza, prima che dia alla luce suo figlio. La resistenza manda un guerriero di nome Kyle Reese nel 1984 per proteggere Sarah.', '1984-10-26', 'Released', 6400000, 78371200, 528, NULL),
(238, 'Il padrino', 'The Godfather', 175, '/r4gnMXoY1efvaolNDjn3nj4046S.jpg', 'Anni Quaranta. Come è consuetudine, durante il rinfresco per festeggiare le nozze della figlia Conny con Carlo, il \"padrino\" don Vito Corleone promette assistenza e protezione a familiari e amici. Invia il figliastro Tom Hagen in California per convincere in ogni modo il produttore Jack Woltz a scritturare il cantante Johnny nel suo prossimo film. Woltz non acconsente. Tom allora lo costringe ad accettare con un \"avvertimento\": l\'uccisione del suo cavallo di razza preferito. Sollozzo, a nome della potente \"famiglia\" Tartaglia, chiede a Corleone finanziamenti e appoggi per il traffico di droga. Il rifiuto scatena una lotta cruenta tra le due cosche: lo stesso don Vito viene ferito gravemente; il figlio minore Michael lo salva da un secondo attentato. Michael, poi, scavalcando l\'irruento fratello Sonny e Tom, temporeggiatore, organizza un incontro con Sollozzo e con il corrotto capitano di polizia McCluskey uccidendoli entrambi.', '1972-03-14', 'Released', 6000000, 245066411, 230, NULL),
(239, 'A qualcuno piace caldo', 'Some Like It Hot', 120, '/aipwXQxe6kPOwB3hyqPprLdeag7.jpg', 'Joe e Jerry, due musicisti assistono per errore al massacro del giorno di San Valentino, a Chicago, nel 1929 e sono costretti a scappare. Per nascondersi si inseriscono un una piccola orchestra tutta femminile, fingendosi donne. Ma per per \"Josephine\" e \"Daphne\" sarà l\'inizio di una lunga serie di equivoci...', '1959-03-19', 'Released', 2883848, 25000000, NULL, NULL),
(240, 'Il padrino - Parte II', 'The Godfather Part II', 200, '/6QPggnaBqLrnlM7EDUMsRR7jXMn.jpg', 'Il film tratta della giovinezza e dei primi passi nel mondo del crimine di Vito Corleone, e delle difficoltà cinquant\'anni più tardi di suo figlio, Michael, a mantenere in piedi l\'impero Corleone. Il tutto tra vicende di emigrazione, tradimenti familiari, inchieste governative e affari.', '1974-12-20', 'Released', 13000000, 102600000, 230, NULL),
(242, 'Il padrino - Parte III', 'The Godfather Part III', 162, '/hK11AO5ys2XXZ79iclOCBQLb2g0.jpg', 'Michael Corleone, il padrino della cupola mafiosa italo-americana, ormai anziano, decide di ripulire la sua vita ed i suoi affari cercando di instaurare un regime di convivenza pacifica con le altre famiglie di New York. Ma a malincuore é costretto a rivedere la sua posizione quando una delle altre famiglie rivendica dei diritti sui Corleone.', '1990-12-25', 'Released', 54000000, 136766062, 230, NULL),
(272, 'Batman Begins', 'Batman Begins', 140, '/53lvq1hrL8NcFW1VXEhfXH0UmWt.jpg', 'Bruce Wayne, figlio di un illuminato filantropo di Gotham City, vede i suoi genitori assassinati da un rapinatore. Incapace di liberarsi del senso di colpa, inizia un vagabondaggio che lo porta fin sulle vette dell\'Himalaya, dove Ra\'s Al Ghul e il suo fido Ducard lo iniziano alla lotta contro il male. Wayne è deciso a servire la giustizia, e una volta tornato a Gotham trova in Falcone, potente trafficante di droga, e in Crane, altrettanto corrotto psichiatra, due acerrimi nemici, dietro ai quali però pare celarsi qualcuno di ancor più potente. L\'unico modo per combatterli è diventare Batman, un simbolo che dia forza e speranza alla gente.', '2005-06-10', 'Released', 150000000, 374218673, 263, NULL),
(274, 'Il silenzio degli innocenti', 'The Silence of the Lambs', 118, '/8P4fZhbiqfeMk2btOeXLu0AKvBl.jpg', 'Dal romanzo omonimo di Thomas Harris. Una giovane recluta dell\'FBI è incaricata di far visita in carcere a Hannibal Lecter, psichiatra pluriomicida, per ottenere informazioni su un assassino psicopatico che ha ucciso e scuoiato cinque donne.', '1991-02-14', 'Released', 19000000, 272742922, 9743, NULL),
(278, 'Le ali della libertà', 'The Shawshank Redemption', 142, '/9OxcvTJwZDjQTFvY2NxiwnSrQS6.jpg', 'Siamo nel 1946. Processato per l\'omicidio della moglie e del suo amante, Andy, un bancario del New England, viene condannato a un doppio ergastolo e recluso nel penitenziario di Shawshank. All\'inizio è vittima delle violenze dei reclusi, poi però diventa il consulente finanziario delle guardie. Scopre così che il direttore falsifica i libri contabili intestando i conti a un fittizio Randall Stevens. Fuggito di prigione attraverso un tunnel costruito negli anni, Andy assume l\'identità di Randall Stevens, denuncia il direttore e va in Messico.', '1994-09-23', 'Released', 25000000, 28341469, NULL, NULL),
(279, 'Amadeus', 'Amadeus', 160, '/jx74Y4u4AlSx5UZQ4ep1io5e2qL.jpg', 'Nel 1823 al manicomio di Vienna Antonio Salieri, acclamato musicista di Corte, confessa un tremendo segreto: ha consumato la vita nel tentativo di distruggere Mozart, volgare e libertino, indegno, secondo lui, dei doni divini. Sotto il segno del più scatenato gusto del gioco, è una riflessione sul contrasto tra genio e mediocrità e sull\'invidia. Scritto dall\'inglese Peter Shaffer, da una sua pièce (1979). Omaggio a Praga. Splendide immagini, due grandi interpreti. 8 Oscar: film, regia, sceneggiatura, attore, costumi, suono, trucco, scenografia. Non tenendo conto che, in fondo, è un Mozart visto da Salieri i molti mozartiani di stretta osservanza hanno eccepito sulla fedeltà storica, specialmente sulle libertà prese per la genesi del Requiem, ma avrebbero da lamentarsi di più i pochi ammiratori di Salieri. Al Festival di Berlino 2002 fu presentata una edizione restaurata (Director\'s Cut) e allungata di oltre 20´.', '1984-09-19', 'Released', 18000000, 51973029, NULL, NULL),
(280, 'Terminator 2 - Il giorno del giudizio', 'Terminator 2: Judgment Day', 137, '/fRzBve23Wa5HWYdiQnFlyL9BLcf.jpg', 'Dieci anni dopo i fatti del primo episodio, un altro, più evoluto Terminator viene inviato sulle tracce di Sarah Connor: stavolta l\'obbiettivo è il figlio John, il futuro leader della ribellione alle macchine che stanno per conquistare il mondo. Ma anche i ribelli, dal futuro, cercheranno di provvedere alla protezione del ragazzo.', '1991-07-03', 'Released', 102000000, 520000000, 528, NULL),
(289, 'Casablanca', 'Casablanca', 102, '/pf1qqufLTApFwHDWRnGMYpM06Nw.jpg', 'Nel principale porto del Marocco nel 1941 si incontrano poliziotti francesi, spie naziste, fuoriusciti antifascisti, avventurieri di rango, piccoli sciacalli. L\'americano Rick Blaine, proprietario di un bar, aiuta Ilsa, la donna che amava (e ama ancora) e suo marito, perseguitato politico, a lasciare in aereo la città.', '1942-11-26', 'Released', 878000, 10462500, NULL, NULL),
(296, 'Terminator 3 - Le macchine ribelli', 'Terminator 3: Rise of the Machines', 109, '/kvf30kx5m1U35WSt9itxwQBewQw.jpg', 'Sono passati dieci anni John Connor, ormai ventiduenne, è nuovamente in pericolo. La terminator femmina T-X, il più potente killer cyborg della Skynet, è stata programmata per ucciderlo. E non è l\'unico bersaglio: l\'ignara veterinaria Kate Brewster vedrà il suo passato scontrarsi con il presente. Per proteggerli viene incaricato e mandato nel passato il T-800...', '2003-07-02', 'Released', 200000000, 435000000, 528, NULL),
(311, 'C\'era una volta in America', 'Once Upon a Time in America', 229, '/dEivhv67W4qOUREIm7P9bNH10Kh.jpg', 'Il quartiere ebraico della New York anni \'20 costituisce il campo delle gesta di una piccola banda di ragazzini. Li capeggiano Max e Noodles, la strada è il loro regno per scippi, furterelli, ricatti al poliziotto di zona e così via. Ma i ragazzi crescono, e l\'epoca del proibizionismo incalza...', '1984-05-23', 'Released', 30000000, 5472914, NULL, NULL),
(335, 'C\'era una volta il West', 'C\'era una volta il West', 166, '/6ldVV8isyLQcFy6VHK8jeGgvepF.jpg', 'Mentre i costruttori della ferrovia marciano inarrestabilmente attraverso il deserto dell\'Arizona sulla loro strada verso il mare, Jill arriva nella piccola città di Flagstone intenzionata a iniziare una nuova vita.', '1968-12-21', 'Released', 5000000, 5380118, NULL, NULL),
(346, 'I sette samurai', '七人の侍', 207, '/e1rmQlUzbGmNUS59UC9cChYfFxa.jpg', 'Nel Giappone del XVI secolo in cui orde di soldati sbandati e dediti al brigantaggio saccheggiano le campagne, la popolazione di un povero villaggio decide di ricorrere ai samurai, nobile casta di soldati di ventura, nella speranza di trovare qualcuno disposto a impegnarsi in un\'impresa così umile e così poco remunerata. Li trovano.', '1954-04-26', 'Released', 2000000, 346300, NULL, NULL),
(348, 'Alien', 'Alien', 117, '/aFQHngtAnMTbz5MfFC2ZxF0oOA4.jpg', 'L\'astronave Nostromo sbarca su un pianeta da cui proviene un SOS, ma la colonia sembra essere disabitata. I coloni sono stati in realtà sterminati da una razza aliena che ha trasformato la base in una gigantesca covata.', '1979-05-25', 'Released', 11000000, 104931801, 8091, NULL),
(389, 'La parola ai giurati', '12 Angry Men', 96, '/6lvkCuYuqpbmK1OPcv5oKleWbgV.jpg', 'Dodici giurati sono riuniti in consiglio per decidere della sorte di un diciottenne accusato d\'omicidio. Undici lo ritengono colpevole. Soltanto uno, Davis, lo considera innocente; trattandosi di una possibile condanna a morte, è necessaria l\'unanimità. Con appassionata eloquenza e con il rigore dei suoi ragionamenti, Davis convince gli altri uno a uno che l\'accusa non regge.', '1957-04-10', 'Released', 350000, 1000000, NULL, NULL),
(406, 'L\'odio', 'La Haine', 98, '/fO9B1SHiTBm2A1pUh6WQinV8V1x.jpg', 'In Le Cité, un quartiere periferico parigino, scoppia il vento della rivolta dopo il pestaggio del sedicenne Abdel Ichaha da parte della polizia. I giovani della banlieu scendono in strada e si battono tutta la notte con gli agenti. Tra loro ci sono tre amici: l\'ebreo Vinz, il maghrebino Saïd e il nero Hubert Dia, un trio di sfigati, disoccupati, arrabbiati e senza futuro.', '1995-05-31', 'Released', 2600000, 15300000, NULL, NULL),
(423, 'Il pianista', 'The Pianist', 150, '/eZaGrYtMM2FnssT7WD4XfWbWEB8.jpg', 'È la storia di Wladyslaw Szpilman, pianista ebreo polacco, attraverso la Seconda Guerra Mondiale, dall’occupazione di Varsavia all’arrivo dell’Armata Rossa. Il film è diviso in due parti: la prima è incentrata sulla famiglia Szpilman, dall’iniziale mix di stupore e indignazione per le leggi razziali alla reclusione nel ghetto, infine alla deportazione; col treno che parte, e Wladyslaw che rimane giù, inizia la seconda parte, la fuga del pianista, il suo continuo cambiar nascondiglio, sempre a un passo dalla cattura, a mezzo dalla morte, a nessuno dall’orrore che in quegli anni ha avvolto Varsavia – non solo Varsavia.', '2002-09-17', 'Released', 35000000, 120072577, NULL, NULL),
(424, 'Schindler\'s List', 'Schindler\'s List', 195, '/m0pV0fmMERzCvPVQbLLrPPLl5q1.jpg', 'Tratto dal libro di Thomas Keneally è la vera storia di Oscar Schindler, industriale tedesco, che nel 1938 capisce che è bene legarsi ai comandanti militari. Li frequenta nei locali notturni, offre bottiglie preziose. Quando gli ebrei sono relegati nel ghetto di Cracovia Schindler riesce a farsene assegnare alcune centinaia come operai in una fabbrica di pentole. All\'inizio sembra sfruttarli, in realtà li salva. Di fronte alla persecuzione tremenda, il tedesco trasforma quella sua prima iniziativa in una vera missione, fino a comprare letteralmente le vite di quasi milleduecento ebrei (la famosa lista) che sicuramente morirebbero nel campo di Auschwitz.', '1993-12-15', 'Released', 22000000, 321365567, NULL, NULL),
(426, 'La donna che visse due volte', 'Vertigo', 128, '/5Aae7GBLVvuCPHlWDhvswcxuaZv.jpg', 'A causa delle sue vertigini, l\'agente Ferguson è a riposo per non aver impedito un incidente mortale a un collega. Un amico gli chiede di sorvegliare sua moglie, che ha manie suicide. Di fronte a Ferguson, paralizzato dalle vertigini, la donna si butta da un campanile, o almeno così crede il povero agente. Ma un giorno un incontro casuale rimette tutto in gioco.', '1958-05-28', 'Released', 2479000, 7797728, NULL, NULL),
(429, 'Il buono, il brutto, il cattivo', 'Il buono, il brutto, il cattivo', 179, '/sOTQkPoEZd7ImsZBuXfu4BqZ6JS.jpg', 'Durante la guerra di Secessione, tre spregiudicati avventurieri, cercano di impossessarsi di un carico d\'oro che gli permetterebbe di chiudere con la vita da pistoleri. Ma la guerra li costringerà a cambiare i loro piani.', '1966-12-23', 'Released', 1200000, 25253887, NULL, NULL),
(489, 'Will Hunting - Genio Ribelle', 'Good Will Hunting', 126, '/6ZnFfCT4JRF8YXQykM2gTOdeaLq.jpg', 'Will Hunting è un ragazzo orfano dedito a piccoli furti, ma con grandi capacità per la matematica. Queste doti vengono notate da un professore universitario, che mandandolo da un suo amico psichiatra cerca di aiutarlo a togliersi dalla strada.', '1997-12-05', 'Released', 10000000, 225933435, NULL, NULL),
(490, 'Il settimo sigillo', 'Det sjunde inseglet', 96, '/ojwrVRmNlwv0WeDKbEsNPRBae6W.jpg', 'Film capolavoro di Ingmar Bergmann sul confronto con la morte. La morte appare ad un cavaliere al suo ritorno dalla battaglia e cerca di portarlo via. Il cavaliere sfida la morte ad una partita a scacchi.', '1957-02-16', 'Released', 0, 0, NULL, NULL),
(497, 'Il miglio verde', 'The Green Mile', 188, '/kptqTcldosy8JPf75JT16oTYUMB.jpg', 'E\' il racconto che Paul Edgecomb fa all\'amica Elaine Connelly in una casa di riposo. Sono passati circa sessanta anni da quando lavorava come capo delle guardie del braccio della morte nel penitenziario di Could Mountain. Durante la grande depressione, nel carcere del sud degli Usa, Edgecomb si occupava di quattro assassini che attendevano di compiere la loro ultima passeggiata lungo il \'Miglio verde\', il corridoio rivestito di linoleum verde che li avrebbe condotti nella stanza della sedia elettrica. Fra questi c\'era anche John Coffrey, un ragazzone nero condannato per l\'omicidio di due gemelline di nove anni. Nonostante avesse le dimensioni e la forza per uccidere chiunque, Coffrey aveva un carattere semplice e ingenuo: era davvero lui il colpevole?', '1999-12-10', 'Released', 60000000, 286801374, NULL, NULL),
(500, 'Le iene', 'Reservoir Dogs', 99, '/noWeDEXd0a8du7tWG9F16Pm3Cvv.jpg', 'Los Angeles. Una rapina a un importatore di diamanti che avrebbe potuto dare un ottimo bottino con un rischio calcolato si trasforma in una sparatoria che costringe i malviventi a una fuga disordinata. C\'è però un punto di ritrovo prestabilito da Joe, il loro capo. Si tratta di un deposito abbandonato che viene raggiunto per primi da Mr. White e Mr. Orange gravemente ferito. Ognuno degli appartenenti alla banda ha finora conosciuto gli altri solo con il nome di un colore per evitare eventuali delazioni. Ma è proprio il dubbio che al loro interno si nasconda un infiltrato della polizia che comincia a tormentare i soggetti che, progressivamente, raggiungeranno il punto di raccolta.', '1992-09-02', 'Released', 1200000, 2859750, NULL, NULL),
(510, 'Qualcuno volò sul nido del cuculo', 'One Flew Over the Cuckoo\'s Nest', 133, '/qalG4ptpwsYj5Scaqd0BiA4CZ1J.jpg', 'Candle McMurphy, arrestato per piccoli reati, viene portato in una clinica psichiatrica: tenta di fingersi pazzo per sfuggire al carcere. Qui viene a contatto con gli altri pazienti dei quali diventa ben presto il beniamino: si prende gioco delle sedute di psicoanalisi, si improvvisa telecronista, organizza una piccola gita in barca. L\'ospedale è diretto dalla ferrea capoinfermiera, la signorina Ratched che ha organizzato la vita dei pazienti secondo regole di intransigente disciplina.', '1975-11-19', 'Released', 3000000, 108981275, NULL, NULL),
(524, 'Casinò', 'Casino', 178, '/v2lGZFMS9fiUUyJ2xvM7zZH7Eps.jpg', 'A Las Vegas, un giocatore d\'azzardo viene assoldato dalla Famiglia per dirigere un casinò. Il suo sogno é quello di diventare ricco e rispettabile ma ad ostacolarlo sarà il carattere della moglie ed un suo amico gangster.', '1995-11-22', 'Released', 52000000, 116112375, NULL, NULL),
(534, 'Terminator Salvation', 'Terminator Salvation', 115, '/uWV7LPoNg08RKLE6I0uAJtGYME2.jpg', 'Anno 2003. Marcus Wright è detenuto nel Braccio della Morte in attesa di ricevere l\'iniezione letale. Ha ucciso suo fratello e due poliziotti e vuole soltanto farla finita ma la dottoressa Serena Kogan ha deciso per lui un altro destino. Firmato un documento legale che consegna il suo corpo alla scienza e gli promette una seconda opportunità, Marcus viene ‘terminato\'. Anno 2018. John Connor, leader ideale e carismatico del genere umano, partecipa alla Resistenza contro Skynet, il network di intelligenze artificiali, e il suo esercito di Terminator indistruttibili. Efficace e intraprendente, è deciso a sferrare un attacco mortale al nemico, a trovare suo padre Kyle Reese e a garantire un futuro all\'umanità dopo l\'apocalisse nucleare scatenata dalle macchine. Lo aiuterà Marcus, galeotto venuto dal passato e portatore di un segreto. Diffidenti ma determinati a vincere la loro battaglia, collaboreranno e troveranno la verità nel cuore.', '2009-05-20', 'Released', 200000000, 371353001, 528, NULL),
(539, 'Psyco', 'Psycho', 109, '/tdqX0MWaFHuGwUygYn7j6eluOdP.jpg', 'Marion Crane, impiegata in una società immobiliare, scappa con 40.000$ rubati dalle casse della ditta. Durante la fuga verso casa del fidanzato però, decide di fermarsi nel Motel gestito dal giovane Norman Bates e dalla madre, che però vive rintanata nella casa attigua al Motel stesso.  Il capolavoro di Alfred Hitchcock.', '1960-06-22', 'Released', 806947, 50000000, 119674, NULL),
(550, 'Fight Club', 'Fight Club', 139, '/rtNLQ8HbPElzEfrHjrzSr07prKT.jpg', 'Un uomo di trent\'anni è insofferente su tutto e la notte non riesce più a dormire. In cerca di qualche luogo dove scaricare la propria ansia si mette a frequentare quei corsi dove gruppi di malati gravi si riuniscono e confessano agli altri le rispettive situazioni. Mentre si lascia andare alla commozione e al pianto di fronte a quello che vede, l\'uomo fa la conoscenza prima di Marla Singer poi di Tyler Durden. Lei è una ragazza a sua volta alla deriva, incapace di scelte o decisioni; lui è un tipo deciso e vigoroso con un\'idea precisa in testa. Tyler fa saltare per aria l\'appartamento dell\'uomo e i due vanno a vivere insieme in una casa fatiscente. Deciso a coinvolgerlo nel suo progetto, Tyler lo fa entrare in un \'Fight Club\', uno stanzone sotterraneo dove ci si riunisce per picchiarsi e in questo modo sentirsi di nuovo vivi...', '1999-10-15', 'Released', 63000000, 100853753, NULL, NULL),
(567, 'La finestra sul cortile', 'Rear Window', 112, '/kWoq5wk8ufremseE3HbCm5ZMxp7.jpg', 'Costretto sulla sedia a rotelle da un incidente sul lavoro che gli ha procurato la frattura della gamba sinistra, un fotoreporter d\'azione passa il tempo spiando col teleobiettivo i suoi vicini di casa, e con l\'aiuto della fidanzata e dell\'infermiera scopre che é stato commesso un omicidio...', '1954-08-01', 'Released', 1000000, 37034514, NULL, NULL),
(582, 'Le vite degli altri', 'Das Leben der Anderen', 137, '/wDeusk4e4uvigGNx6IYibMOrNks.jpg', 'Nei primi anni Ottanta, il drammaturgo di successo Georg Dreyman e la sua compagna di sempre, la famosa attrice Christa-Maria Sieland, si trasferiscono a Berlino Est. I due sono considerati dalla DDR tra i più importanti intellettuali del regime comunista e sono tenuti in grande considerazione, malgrado in cuor loro Georg e Christa-Maria non siano sempre allineati con la linea del partito. Un giorno il ministro della cultura assiste ad uno spettacolo dell\'attrice e se ne innamora. Chiede allora a Gerd Wiesler, uno dei più valorosi agenti della Stasi, di avvicinare la coppia, conoscerla meglio, ed osservare ogni loro spostamento e interesse. Sarà la vita di Gerd ad essere cambiata dal rapporto con lo scrittore.', '2006-03-15', 'Released', 2000000, 70000000, NULL, NULL),
(598, 'City of God', 'Cidade de Deus', 130, '/5jgo0yek9pzYF94aNaVrvKgfo2k.jpg', 'Rio de Janeiro, dagli anni ’60 agli ’80. La favela di Cidade de Deus diventa il palcoscenico delle storie parallele di Buscapé e Dadinho. Entrambi tredicenni, sono però mossi da ambizioni diversissime: il primo vorrebbe diventare fotografo, il secondo il più temuto criminale della città. Se Buscapé trova molti ostacoli nella realizzazione dei propri sogni, Dadinho diventa rapidamente padrone del quartiere e del narcotraffico con lo pseudonimo di Zé Pequeno. La morte del suo braccio destro Bené e la violenza perpetrata ai danni della fidanzata del mite Galinha innescheranno una guerra tra bande dall’esito tragico.', '2002-02-05', 'Released', 3300000, 30641770, NULL, NULL),
(600, 'Full Metal Jacket', 'Full Metal Jacket', 115, '/swLFjsSM1iEo3yTWsBu9N4frfZk.jpg', 'In un campo di addestramento dei Marines nel South Carolina diciassette giovani civili vengono trasformati in macchine da guerra e di morte. Partito per il Vietnam, uno dei diciassette lavora per un giornale militare e si trova coinvolto nell\'offensiva del Tet.', '1987-06-26', 'Released', 30000000, 46357676, NULL, NULL),
(603, 'Matrix', 'The Matrix', 136, '/5uCQOswAMkOqUZiNzOxvckw59e3.jpg', 'Seguendo un tatuaggio sulla spalla di una ragazza, l\'hacker Neo scopre che la cosiddetta \"realtà\" è solo un impulso elettrico fornito al cervello degli umani da un\'intelligenza artificiale. Per sopravvivere alla catastrofe l\'umanità ha infatti avuto bisogno delle macchine, ma queste hanno vinto e necessitano degli uomini come fonte di energia. L\'illusione in cui li fanno vivere è quindi finalizzata a \"coltivarli\" meglio. Nessuno è a conoscenza del tempo che è passato da quando il neurosimulatore ha assegnato una data fittizia al tempo. Solo Neo, con l\'aiuto del pirata informatico Morpheus e della bella Trinity, può tentare di scoprire la verità, ma non sarà un\'impresa facile.', '1999-03-30', 'Released', 63000000, 463517383, 2344, NULL),
(604, 'Matrix Reloaded', 'The Matrix Reloaded', 138, '/bgx0hblyE1XYWHFFewrYjXE6DeQ.jpg', 'Ora Neo controlla perfettamente i suoi straordinari poteri e Zion è assediata dall\'Esercito delle Macchine. Solo poche ore separano l\'ultima enclave umana sulla Terra da 250.000 Sentinelle programmate per distruggere il genere umano. Ma i cittadini di Zion, incoraggiati dalla convinzione di Morpheus che L\'Eletto adempierà la Profezia dell\'Oracolo e metterà fine alla guerra con le Macchine, puntano tutte le loro speranze su Neo, che si ritrova bloccato da visioni sconvolgenti. Resi più forti dall\'amore e dalla fiducia che li lega, Neo e Trinity scelgono di tornare in Matrix con Morpheus e di lottare contro le forze della repressione e dello sfruttamento. Ma esistono ancora figure potenti dentro Matrix che si oppongono all\'artificio della scelta, e si sottraggono alla responsabilità che comporta, poiché si cibano delle verità emotive degli altri.', '2003-05-15', 'Released', 150000000, 738599701, 2344, NULL),
(605, 'Matrix Revolutions', 'The Matrix Revolutions', 129, '/oCB8tMvo5dd4j1NN2bLlXbgoeRB.jpg', 'Neo è in coma nell\'infermeria della Hammer, ma la sua mente si trova intrappolata in una sorta di limbo situato tra il mondo reale e matrix. Il creatore del limbo virtuale è un nuovo personaggio, enigmatico e misterioso quanto la figura del fabbricante di chiavi, ma con un dentista decisamente peggiore. Toccherà ai compagni di Neo l\'arduo compito di liberarlo, tornando nel castello del Merovingio, che muove i fili del gioco. Riuscirà Zion a resistere all\'inesorabile avanzata delle macchine? Potrà l\'eletto sconfiggere il suo nemico giurato, l\'agente Smith?', '2003-11-05', 'Released', 150000000, 424988211, 2344, NULL),
(629, 'I soliti sospetti', 'The Usual Suspects', 105, '/uiM4U4kuQgjmXSWkYkxHnqTuJgx.jpg', 'Cinque criminali si ritrovano incomprensibilmente insieme in un confronto all\'americana. Scopriranno che dietro a tutto c\'è il re dei malfattori, Keyser Soze, che li costringerà a partecipare ad una missione suicida.', '1995-07-19', 'Released', 6000000, 23341568, NULL, NULL),
(637, 'La vita è bella', 'La vita è bella', 116, '/Moz0CzJ44U9L3ADxlVE24LTwY4.jpg', 'Guido, un giovane ebreo amante della vita e della poesia, si reca ad Arezzo con l\'amico Ferruccio in cerca di lavoro. Si fa assumere come cameriere dallo zio Eliseo, che gestisce il Grand Hotel, e s\'innamora di Dora, un\'insegnante promessa sposa all\'antipatico fascista Rodolfo. Con l\'esuberanza e l\'allegria del suo carattere, riesce a vincere le reticenze della maestrina, e a sposarla. Sei anni dopo, probabilmente denunciato dalla suocera che non ha mai digerito il matrimonio, Guido è deportato in un campo di concentramento con lo zio Eliseo e col suo figlioletto, il piccolo Giosuè, mentre Dora, pur non essendo ebrea, decide di seguirli di sua iniziativa.', '1997-12-20', 'Released', 20000000, 230098753, NULL, NULL),
(641, 'Requiem for a Dream', 'Requiem for a Dream', 102, '/3E8RFYisnqy93251alK66bbGNpE.jpg', 'Sara è una casalinga sola e depressa che sogna di partecipare ad uno show televisivo, il suo unico figlio, Harry, è un tossicodipendente che passa le sue giornate alla ricerca di droga insieme all\'amico Tyrone. La ragazza di Harry, Maryon, è una borghese annoiata e problematica, anche lei tossicodipendente. Quattro vite ai margini, quattro storie destinate a risolversi tragicamente.', '2000-10-06', 'Released', 4500000, 7390108, NULL, NULL),
(670, 'Oldboy', '올드보이', 119, '/idBaREsAGTjPZPrlAd1w8SVzUzd.jpg', 'È la storia di Dae-su, imprigionato per 15 anni senza sapere perché, e della sua implacabile vendetta una volta libero. Non dovrà cercare lontano, perché il suo persecutore non ha ancora chiuso la partita. L\'appena conosciuta e subito amata Mi-do lo accompagnerà alla ricerca della rivincita e, più ancora, del motivo della sua prigionia.', '2003-11-21', 'Released', 3000000, 15194593, NULL, NULL),
(671, 'Harry Potter e la pietra filosofale', 'Harry Potter and the Philosopher\'s Stone', 152, '/5VvepiOtW4aJYRnGfPP7IyA58lv.jpg', 'Harry Potter vive con gli zii e il cuginetto sin dalla più tenera età dopo la morte dei suoi genitori. I parenti non lo amano per nulla. Harry sta ormai per compiere undici anni e viene guardato male anche per alcune sue capacità \'magiche\'. Che sono effettive perché Harry è figlio di maghi e comincia a ricevere lettere, regolarmente sequestrate, portate da gufi. Dovrà giungere il gigantesco Hagrid a recapitargliene personalmente una perché possa apprendere di essere stato ammesso a frequentare la Scuola di Magia e Stregoneria di Hogwarts. Gli zii a questo punto non possono far più nulla e Harry raggiunge la Scuola dove apprende che il suo nome è già noto e dove scoprirà di avere naturali doti magiche.', '2001-11-16', 'Released', 125000000, 976475550, 1241, NULL),
(672, 'Harry Potter e la camera dei segreti', 'Harry Potter and the Chamber of Secrets', 161, '/o8nKMrvRr8MaK7Y7d68IprD9npf.jpg', 'Harry Potter sta trascorrendo noiose vacanze estive presso gli zii, oltretutto senza aver ricevuto nemmeno un messaggio dagli amici Ron e Hermione. Colpa di Dobby, elfo domestico che ha intercettato la posta per convincere il ragazzo a lasciare la scuola di magia di Hogwarts dove lo attenderebbe un terribile pericolo. L\'arrivo all\'accademia coincide in effetti con una serie di strani e paurosi fenomeni: esseri pietrificati, scritte di sangue sui muri e soprattutto l\'accenno a una misteriosa \"camera dei segreti\" che conterrebbe qualcosa di malefico. Quando il pericolo comincerà a riguardare i suoi amici Harry saprà risolvere la situazione.', '2002-11-13', 'Released', 100000000, 876688482, 1241, NULL),
(673, 'Harry Potter e il prigioniero di Azkaban', 'Harry Potter and the Prisoner of Azkaban', 142, '/xTm1NVePaSKAypcPTJEM0tnGh6A.jpg', 'Harry Potter ha tredici anni e deve trascorrere ancora una volta le vacanze estive con i terribili zii Dursley, i suoi unici parenti, che hanno un atteggiamento davvero medioevale nei confronti della magia e vivono nel terrore che qualcuno scopra che il nipote frequenta la Scuola di Magia e Stregoneria di Hogwarts. Tutto fila liscio fino all\'arrivo di zia Marge, la prepotente sorella di zio Vernon, che maltratta talmente tanto Harry da spingerlo \"involontariamente\" a farla gonfiare come un mostruoso pallone che si libra nell\'aria. Temendo di essere punito dagli zii (e da Hogwarts, perchè il Ministero della Magia proibisce severamente agli studenti di usare le arti magiche nel mondo dei Babbani), Harry fugge nella notte...', '2004-05-31', 'Released', 130000000, 789804554, 1241, NULL),
(674, 'Harry Potter e il calice di fuoco', 'Harry Potter and the Goblet of Fire', 157, '/rZkMtwU1Gx2tyXcmsuFLVoDNwea.jpg', 'La scuola di Hogwarts ospita quest\'anno il Torneo Tremaghi, famosa competizione in cui tre studenti, appartenenti a tre scuole di magia diverse, dovranno sfidarsi in pericolose prove. Il Calice di Fuoco ha scelto anche Harry, il quale, suo malgrado, dovrà partecipare al Torneo, nonostante la sua giovane età. Un\'altra avventura ha inizio per il maghetto quattordicenne, che dovrà combattere con il famigerato Lord Voldemort...', '2005-11-16', 'Released', 150000000, 895921036, 1241, NULL),
(675, 'Harry Potter e l\'ordine della fenice', 'Harry Potter and the Order of the Phoenix', 138, '/iXg8dcylRbYNREcdU1Y2EGxpxxe.jpg', 'Voldemort è tornato ma nessuno al Ministero della Magia sembra crederci. Harry, sopravvissuto col cugino Dudley all\'attacco dei Dissennatori, viene espulso da Hogwarts per avere usato impropriamente la magia davanti ad un babbano. Silente reintegra il ragazzo e lo introduce nell\'Ordine della Fenice, un gruppo di nobili cavalieri magici avversari di Voldemort. Questo esercito \"templare\" combatte su due fronti e due poteri: quello maligno e potente dei Mangiamorte e quello politico e ottuso di Caramell, che si ostina a negarne il ritorno. Rimosso Silente dalla presidenza di Hogwarts, questa volta Harry dovrà cavarsela da solo. Ma nuovi e giovani membri si uniranno alla resistenza contro Voldemort.', '2007-06-28', 'Released', 150000000, 938212738, 1241, NULL),
(679, 'Aliens - Scontro Finale', 'Aliens', 137, '/qSaOo9JCDCFc1cvYiBzEooPe36U.jpg', 'Il \"capitano\" Ellen Ripley, ibernata per sessant\'anni in un sofisticato contenitore del traghetto spaziale Nostromo, e quindi rimasta giovane, è l\'unica sopravvissuta alla terribile disavventura che ne ha distrutto l\'equipaggio e che ora sconvolge le sue notti con incubi ricorrenti, che si riferiscono alle forme mostruose di vita incontrate sul pianeta Archeron, dove ora vive una colonia di pionieri dello spazio. Quando le viene affidata la missione di scoprire il perchè sia stato misteriosamente interrotto il contatto con quel remoto pianeta, Ellen si trova ad affrontare le spaventose proliferazioni del mostro da cui era avventurosamente sfuggita. Allora infatti c\'era un solo alieno, ora vivono là innumerevoli mostruosi alieni, che si riproducono con ritmo frenetico, sempre più avidamente affamati di essere umani.', '1986-07-18', 'Released', 18500000, 183316455, 8091, NULL),
(680, 'Pulp Fiction', 'Pulp Fiction', 154, '/9p10J9Xp7MuaVac56g8BwAuXEsA.jpg', 'Le vite di due gangster, di un pugile e della moglie di un potente boss della malavita finiscono per intrecciarsi in una paradossale storia di violenza, vendetta e redenzione.', '1994-09-10', 'Released', 8000000, 214179088, NULL, NULL);
INSERT INTO `film` (`id`, `titolo`, `titolo_originale`, `durata`, `copertina`, `descrizione`, `data_rilascio`, `stato`, `budget`, `incassi`, `collezione`, `voto`) VALUES
(694, 'Shining', 'The Shining', 142, '/r7AAFgo4qE10yXH6VUFFoparw2A.jpg', 'L\'aspirante scrittore Jack Torrance si trasferisce tra i monti per trovare il giusto isolamento che gli permetterà di completare il suo romanzo. L\'uomo accetta quindi l\'incarico di custode invernale di un enorme albergo tra le montagne, dove lo seguono la moglie e il figlioletto Danny, il quale possiede poteri paranormali che gli permettono di vedere nel passato e nel futuro.', '1980-05-23', 'Released', 19000000, 44781695, 530064, NULL),
(744, 'Top Gun', 'Top Gun', 110, '/ckcBKTXdh67mwDFBTDmmvxbW71l.jpg', 'Pete \"Maverick\" Mitchell, un Tom Cruise in piena forma, e Nick \"Goose\" Bradshaw (Anthony Edwards) sono rispettivamente pilota e navigatore di aerei da guerra, nonché cadetti della prestigiosa scuola per i Top Gun, la crème de la crème dell\'aeronautica militare americana. Fra molteplici acrobazie aeree e spacconate assortite si avvicenda la storia d\'amore tra Maverick e Charlie, l\'insegnante di volo interpretata da un\'affascinante Kelly McGillis. Il pilota protagonista nella parte conclusiva del film si troverà a dover fare i conti con una crisi depressiva che gli farà perdere la fiducia nelle sue doti da pilota e che lo metterà a dura prova durante una missione aerea contro la minaccia comunista, priva di volto, anonima, personificata dagli aerei Mig russi.', '1986-05-16', 'Released', 15000000, 356830601, 531330, NULL),
(767, 'Harry Potter e il principe mezzosangue', 'Harry Potter and the Half-Blood Prince', 153, '/bJlJBz5CMfoIhj9UNULUzTAj61y.jpg', 'Tempi oscuri minacciano il mondo dei maghi e quello dei babbani. Dopo il ritorno di Voldemort e la tragica morte di Sirius Black, Harry trova conforto, guida e consolazione in Silente, che lo conduce ad Hogwarts e lo invita alla condivisione dei suoi ricordi. Albus filtra per Harry l\'infanzia di Tom Ridlle in cerca di un indizio che possa aiutarli a distruggerlo. La chiave della loro indagine è però custodita e mai rivelata nella memoria di Horace Lumacorno, professore in pensione di Pozioni. L\'allettante possibilità di insegnare all\'Eletto, lo conduce di nuovo in cattedra e lo persuade a rivelare il segreto dell\'Oscuro Signore: l\'anima di Voldemort, straziata in sette parti dall\'orrore compiuto, è conservata e protetta in altrettanti oggetti. Silente e Potter lasciano Hogwarts alla ricerca del medaglione che custodisce un frammento dello spirito del Serpeverde. Nei corridoi della scuola intanto un altro Eletto, Draco Malfoy, è determinato a lasciare un segno nella storia.', '2009-07-07', 'Released', 250000000, 933959197, 1241, NULL),
(769, 'Quei bravi ragazzi', 'GoodFellas', 145, '/7Ce724ZcEt7Id9EwBFFdXuvDxWA.jpg', 'Henry Hill, figlio di emigranti italo-irlandesi, fin da giovane entra a far parte della piccola mafia dei quartieri poveri di New York. Ma ben presto scopre la ferocia dei boss locali che usano chiamarsi fra di loro \"bravi ragazzi\"...', '1990-09-12', 'Released', 25000000, 46835000, NULL, NULL),
(807, 'Seven', 'Se7en', 127, '/1XHq0Z7BkjeQ9J5CLmWD0xX0DuB.jpg', 'Un killer astuto e spietato sta uccidendo a raffica, nei modi più raccapriccianti, personaggi scelti con cura. Sulle sue tracce ci sono il giovane e ambizioso Mills, alla prima missione, e l\'esperto Somerset, ormai prossimo alla pensione; personalità opposte che mal si tollerano a vicenda. Imparano a \"convivere\" man mano che la caccia all\'assassino si fa più serrata e il mistero comincia a districarsi: il mostro sceglie le vittime e le uccide seguendo i sette peccati capitali (gola, avarizia, accidia, lussuria, superbia, invidia e ira).', '1995-09-22', 'Released', 33000000, 327311859, NULL, NULL),
(857, 'Salvate il soldato Ryan', 'Saving Private Ryan', 169, '/iRvttKKh8ZSWNYXPxDm3IUqLlB3.jpg', 'Il 6 giugno 1944 il cap. John Miller (Hanks) sbarca con i suoi uomini a Omaha Beach. È un massacro sotto il micidiale fuoco tedesco. Il generale George Marshall (Presnell), comandante supremo dell\'armata angloamericana, apprende che la famiglia Ryan dell\'Iowa ha già perduto tre figli e che un quarto fratello, James Francis Ryan (Damon), è stato paracadutato in Normandia oltre le linee nemiche. Dà ordine che sia ritrovato e rimandato a casa. L\'incarico è affidato al cap. Miller che, con sei uomini e un interprete (Davies), parte alla sua ricerca.', '1998-07-24', 'Released', 70000000, 481840909, NULL, NULL),
(872, 'Cantando sotto la pioggia', 'Singin\' in the Rain', 102, '/n1sQsVV2rWNrY7l20f2HPVHc2M7.jpg', 'Don, un giovane attore di varietà, decide di tentare la fortuna passando al cinema. Viene ingaggiato per affiancare la bellissima attrice Lina Lamont in un film muto e la pellicola ottiene uno strepitoso successo.', '1952-04-09', 'Released', 2540800, 7200000, NULL, NULL),
(914, 'Il grande dittatore', 'The Great Dictator', 126, '/xfeicttLCv7HTaPQ9Z5dKuI0fIq.jpg', 'In Tomania il dittatore Adenoid Hynkel scatena la repressione contro gli ebrei. La bella Hannah e il suo innamorato, un barbiere straordinariamente somigliante a Hynkel, fuggono. Il barbiere, dapprima catturato, scappa dal lager e si imbatte per caso nel vero dittatore che viene arrestato in vece sua. Dai microfoni del führer il barbiere pronuncia al mondo un lungo messaggio di pace e speranza.  Primo film interamente parlato di Chaplin, è una geniale satira antinazista realizzata quando le armate del Terzo Reich avevano ormai soggiogato l\'intera Europa. Tra le sequenze da antologia, la danza di Hynkel con il mappamondo e i duetti con Napoloni/ Mussolini.', '1940-10-15', 'Released', 2000000, 11000000, NULL, NULL),
(935, 'Il dottor Stranamore, ovvero: come ho imparato a non preoccuparmi e ad amare la bomba', 'Dr. Strangelove or: How I Learned to Stop Worrying and Love the Bomb', 95, '/eQG4dGLeOZZBSevOtSvSQhclp08.jpg', 'Uno psicopatico generale dell\'aviazione USA, deciso a salvare il mondo dal complotto comunista, è pronto ad attaccare l\'Unione Sovietica con armi nucleari. Uno dei pochi capolavori di satira politica nella storia del cinema che riflette gli incubi apocalittici dei primi anni \'60. Il più forsennato e meno controllato film di Kubrick con Peter Sellers in 3 ruoli al culmine del suo istrionismo. Non vinse nemmeno uno dei 4 Oscar cui era candidato. Dal romanzo Red Alert (1958) di Peter George che lo sceneggiò con Terry Southern e il regista.', '1964-01-29', 'Released', 1800000, 9523464, NULL, NULL),
(938, 'Per qualche dollaro in più', 'Per qualche dollaro in più', 132, '/1xCzSCTyDaRh8uj1iGEVtlaxe4e.jpg', 'Due cacciatori di taglie sulle tracce di un bandito sanguinario e megalomane.Un cacciatore di taglie, poncho sulle spalle ed eterno sigaro in bocca, si associa con un suo collega, molto più distinto ma altrettanto spietato, per dare la caccia all\'Indio. Questi è un feroce fuorilegge che, evaso con l\'aiuto dei suoi compari, organizza una rapina alla banca di El Paso. Ma non andrà molto lontano. Dopo lo strepitoso successo di  \"Per un pugno di dollari\"  Leone ripropone i suoi personaggi. Eccessivo e barocco, padrone di uno stile immediatamente riconoscibile tra i tanti imitatori già all\'opera, Leone consolida la sua fama. Da ricordare Volonté nei panni dell\'Indio e la comparsata di Klaus Kinski, gobbo e nevrotico.', '1965-12-18', 'Released', 600000, 15000000, NULL, NULL),
(1091, 'La cosa', 'The Thing', 104, '/h1lYX878rUq0SidQNCC2w0fqPPN.jpg', 'Gli scienziati di una base di ricerche in Alaska raccolgono un cane lupo che i loro colleghi norvegesi hanno tentato di abbattere. Lo mettono nel canile mentre due di essi si recano nella base norvegese che trovano abbandonata e piena di cadaveri. Trovano anche i resti di quello che sembra un disco volante. In breve il cane viene posseduto da una strana forza e si trasforma in belva. Il panico si diffonde nella base.', '1982-06-25', 'Released', 15000000, 19629760, 479888, NULL),
(1124, 'The Prestige', 'The Prestige', 130, '/xKsiJimxRa44FArhlfGHnylrT0i.jpg', 'Due giovani maghi apprendisti, Robert Angier e Alfred Borden, vengono istruiti e seguiti da Cutter, un ingegnere illusionista ed ex mago, ma durante un numero in cui una donna viene legata e messa in una cassa di vetro piena d\'acqua, qualcosa va storto e Angier incolperà l\'amico dell\'accaduto, tentando di vendicarsi. Inizia così un crudele gioco tra i due uomini su chi sia il migliore e la rivalità si trasformerà pian piano in ossessione.', '2006-10-19', 'Released', 40000000, 109676311, NULL, NULL),
(1248, 'Hannibal Lecter - Le origini del male', 'Hannibal Rising', 121, '/lvWZoy1dEb6kFggNpBMdKNoxQsD.jpg', 'In Lituania, un adolescente, reso orfano dalla guerra e muto dagli orrori di cui è stato testimone, si ritrova chiuso in un orfanotrofio sovietico dove deve fare i conti con le prepotenze dei suoi perfidi compagni. Ma non è un ragazzo come tanti altri: è il giovane Hannibal Lecter. Dopo una rocambolesca fuga oltre la cortina di ferro, raggiunge la periferia di Parigi, in Francia, dove risiede lo zio, suo unico parente ancora in vita. Giunto a Lecter Castle, Hannibal scopre che l\'uomo è morto, ma la sua bellissima e misteriosa vedova giapponese, Lady Murasaki Shibuku, lo accoglie in casa.', '2007-02-06', 'Released', 50000000, 82169884, 9743, NULL),
(1422, 'The Departed - Il bene e il male', 'The Departed', 149, '/mSEFwJ1y7V3dmyfX0Yn4GIyXvqi.jpg', 'Boston. È in atto una guerra tra la polizia locale e una banda della malavita organizzata. Billy Costigan, giovane poliziotto in incognito, riceve l\'incarico di infiltrarsi nella gang capeggiata dal boss Frank Costello. Mentre Billy guadagna rapidamente la fiducia di Costello, Colin Sullivan, giovane criminale incallito infiltrato nel dipartimento di polizia come informatore della gang, guadagna una posizione di rilievo nell\'unità speciale di investigazione. Sia Billy che Colin vivono questa doppia vita come un\'esperienza alienante, ma appena appare chiara l\'esistenza di una talpa, sia all\'interno della polizia che fra i gangster, entrambi dovranno, in una corsa contro il tempo, scoprire l\'identità dell\'altro per salvarsi.', '2006-10-04', 'Released', 90000000, 291465000, NULL, NULL),
(1585, 'La vita è meravigliosa', 'It\'s a Wonderful Life', 129, '/dz4uDePDp8wJd9qRyk63ZzbGZ2Y.jpg', 'È la viglia di Natale e George Bailey è solo, su un ponte, con cattive intenzioni. Lui che ha rinunciato a tutto pur di mandare avanti l\'attività del padre, morto prematuramente, ora si trova di fronte allo spettro del fallimento. Sarebbe stato meglio non esser mai nati, pensa lui. A quel punto scende giù dal cielo un angelo a mostrargli cosa sarebbe successo se lui non fosse mai nato.', '1946-12-20', 'Released', 3180000, 9644124, NULL, NULL),
(1891, 'L\'Impero colpisce ancora', 'The Empire Strikes Back', 124, '/a8Vdzh5lXdX6t7LGxPJ1m0tvimq.jpg', 'Malgrado la Morte Nera sia stata distrutta, le truppe imperiali si sono impadronite nuovamente di Yavin. I ribelli si sono rifugiati sul pianeta di ghiaccio, ma sono costretti ancora alla fuga. Ian Solo (Han Solo nome originale), la principessa Leia e il droide D3BO (C-3PO), seminano gli inseguitori, mentre Luke, assieme al fido C1P8 (R2-D2) , si reca dal maestro jedi Yoda, sul pianeta Dogabahd, per ritrovare la \"Forza\". Nel tentativo di liberare Leila e gli amici, incontra poi Darth Vader, che si rivela essere suo padre. Seconda puntata (ma in realtà è la quinta) della saga di \"Guerre stellari\", con parecchie allusioni al celebre ciclo narrativo dei cavalieri bretoni: abbastanza evidente il parallelo tra Luke alla ricerca della \"forza\" e Parsifal.', '1980-05-20', 'Released', 18000000, 538400000, 10, NULL),
(1892, 'Il ritorno dello Jedi', 'Return of the Jedi', 134, '/iz39GyVKyNHcg22qGOqGAiL9G7v.jpg', 'Mentre gli Imperiali sono impegnati nella costruzione di una nuova e indistruttibile Morte Nera, Luke Skywalker diventato finalmente un cavaliere jedi, la principessa Leila, Chewbacca e i due droidi D3BO (C-3PO nome originale) e C1P8 (R2-D2 nome originale) cercano di liberare Ian Solo (Han Solo nome originale), che è prigioniero del criminale intergalattico Jabba.Per poi affronta il crudele alfiere del male Lord Vader (Darth Vader nome originale), scoprendo che gli è padre e che la principessa Leia è sua sorella, ma l\'insurrezione non ha successo e Luke viene catturato dell\'imperatore, che cerca di portare il giovane dalla sua parte. Terzo (o meglio sesto) e ultimo episodio della saga ideata da George Lucas.', '1983-05-25', 'Released', 32350000, 572700000, 10, NULL),
(1893, 'Star Wars: Episodio I - La minaccia fantasma', 'Star Wars: Episode I - The Phantom Menace', 136, '/7ozBHvOoDDi4UcBWbz3N7SGOKdm.jpg', 'Il regno pacifico di Naboo denuncia l\'imminente invasione da parte della Lega dei Commercianti, ma la Repubblica, paralizzata dalla corruzione dilagante e dalla burocrazia del Senato, sceglie di non intervenire. Solo i Cavalieri Jedi Qui-gon Jin e Obi-wan Kenobi si recano a Naboo per proteggere la regina Amidala, in pericolo di vita, e condurla in salvo sul pianeta Tatooine. Qui i Jedi faranno la conoscenza di un bambino fuori dall\'ordinario, Anakin Skywalker: Qui-gon è convinto che si tratti del Prescelto, destinato un giorno a riportare equilibrio nella Forza.', '1999-05-19', 'Released', 115000000, 924317558, 10, NULL),
(1894, 'Star Wars: Episodio II - L\'attacco dei cloni', 'Star Wars: Episode II - Attack of the Clones', 142, '/2fYL7A7lDzApoTQuwGheMlhmq5e.jpg', 'La Repubblica governata dal cancelliere Palpatine è entrata in crisi a causa del blocco in atto sul pianeta Naboo da parte della Federazione; un gruppo di dissidenti comandato dal Jedi conte Dooku manifesta il malcontento per ciò che sta accadendo. Alcuni membri del Senato chiedono che la Repubblica venga dotata di un esercito in grado di fronteggiare la situazione. Nel frattempo Amidala - diventata Senatrice e minacciata dai separatisti - è sfuggita a un attentato: la sua protezione viene affidata a Anakin Skywalker. Nel tentativo di scoprire gli ideatori del complotto, Obi-Wan Kenobi viene a conoscenza dell\'esistenza di un misterioso esercito di cloni...', '2002-05-15', 'Released', 120000000, 649398328, 10, NULL),
(1895, 'Star Wars: Episodio III - La vendetta dei Sith', 'Star Wars: Episode III - Revenge of the Sith', 140, '/esVM3WBadZkdR4idKleum9yNt3M.jpg', 'Tre anni dopo l\'inizio della Guerra dei Cloni il lungo ed estenuante conflitto sta per giungere ad una conclusione. Obi-Wan Kenobi e Anakin Skywalker stanno per avere rivelazioni sconvolgenti. Il pianeta Coruscant è sotto attacco e per mano del Generale Grievous, il loro compito è di assicurare il Generale alla giustizia, ma il Cancelliere Palpatine sta trasformando la Repubblica in un regime tirannico, nonostante l\'opposizione dell\'Ordine degli Jedi e di pochi senatori ancora non corrotti. Anakin, divenuto sempre più vicino al Cancelliere, nel frattempo soffre di moleste visioni a proposito della Senatrice Padme Amidala, sposata in segreto. Sin dall\'inizio della Guerra dei Cloni si è andato avvicinando sempre più al Lato Oscuro della Forza, incoraggiato da Palpatine, e presto lo scontro diverrà inevitabile. Obi-Wan Kenobi non avrà altra scelta che confrontarsi col suo antico apprendista in una battaglia mentre si affaccia un nuovo conflitto che determinerà il destino della Galassia.', '2005-05-17', 'Released', 113000000, 850000000, 10, NULL),
(1955, 'The Elephant Man', 'The Elephant Man', 124, '/pPZYjdZ59fhxzNJgXZ3eZ0O3Vni.jpg', 'Londra, seconda metà dell\'Ottocento. A causa di una malattia molto rara, la neurofibromatosi, che gli ha dato sembianze mostruose, il giovane John Merrick viene esposto come \"uomo elefante\" nel baraccone di Bytes, un alcolizzato che campa sfruttando la sua mostruosità e lo tratta come una bestia. E\' qui che Merrick viene scoperto dal dottor Frederick Treves, un chirurgo del London Hospital che convince Bytes a cederglielo per qualche tempo in modo da poterlo studiare e curare. Portato in ospedale e presentato a un congresso di scienziati, John si rivela ben presto agli occhi di Treves come un uomo di intelligenza superiore e di animo raffinato e sensibile.', '1980-10-09', 'Released', 5000000, 26010864, NULL, NULL),
(3082, 'Tempi moderni', 'Modern Times', 87, '/n7GhshWYUq5f7MxwMNxuOceazXo.jpg', 'Charlot, operaio in un grande complesso industriale, estenuato dal ritmo frenetico di lavoro, perde la ragione. Ricoverato in una casa di cura, viene dimesso qualche tempo dopo per finire però quasi subito in prigione, a causa di una manifestazione di operai nella quale si ritrova casualmente coinvolto. Durante la detenzione, egli concorre, inconsapevole, a sventare una rivolta di detenuti; ciò gli frutta l\' immediata scarcerzione. Una volta libero, riprende la sua dura lotta per sopravvivere: gli è di conforto l\' amicizia di una giovane orfana, con cui divide fraternamente la propria casetta e quel po\' di cibo che riesce a procurarsi. Quando la ragazza trova lavoro in un cabaret e riesce a far assumere anche Charlot, ai due derelitti sembra schiudersi la prospettiva di un futuro migliore. La polizia, venuta a cercare la ragazza per ricondurla all\' orfanotrofio, li costringe però a fuggire dalla città per cercare altrove un po\' di tranquillità.', '1936-02-05', 'Released', 1500000, 0, NULL, NULL),
(4348, 'Orgoglio e pregiudizio', 'Pride & Prejudice', 129, '/bA4gEvNLIpwVV1JaU4S4yueLjP8.jpg', 'Nell\'Inghilterra rurale di fine \'700 un giovane aristocratico a cui non difettano le ricchezze, Charles Bingley, affitta la tenuta vicina a quella dei Bennet, a cui non difettano invece le figlie da maritare. Una sera, durante una festa danzante, Bingley fa il suo ingresso nella sala scatenando lo scompiglio fra le fanciulle del paese che desiderano un giro di danza e un (buon) partito. Accompagnato dall\'altezzosa sorella e dal bello quanto presuntuoso Signor Darcy, Bingley si innamora perdutamente della primogenita dei Bennet, la timida e placida Jane. Amore a prima vista sarebbe anche per Darcy e la secondogenita Bennet, Lizzie, se non fosse per quella loro indole indomita e poco incline al confronto.', '2005-09-16', 'Released', 28000000, 121147947, NULL, NULL),
(4437, '2010 - L\'anno del contatto', '2010', 116, '/aExyNrGeuenYUuwKlHcynsdZuIE.jpg', 'Nove anni dopo la spedizione del Discovery, scienziati sovietici e americani partono a bordo dell\'astronave Leonov verso Giove per scoprire il mistero del monolito nero e le ragioni del precedente fallimento. Deludente seguito del magistrale 2001: Odissea nello spazio (1968) di Kubrick. Hyams cerca di essere meno mistico e più concreto, ma ci riesce solo in parte. Ammirevoli effetti speciali di Richard Edlund. A.C. Clarke, anche qui autore del testo originale, ha dato alle stampe un 3° capitolo 2061: Odissea tre.', '1984-12-06', 'Released', 28000000, 40400657, 4438, NULL),
(4935, 'Il castello errante di Howl', 'ハウルの動く城', 119, '/q46kf8ElR1ej9tSrlNgAFMe3IAM.jpg', 'Sophie ha diciotto anni e ogni giorno lavora instancabilmente nel negozio di cappelli del suo defunto padre. Un giorno, durante una rara escursione in città, per caso incontra il Mago Howl. Howl è ardito e bello, ma come tutti i maghi un po\' smidollato. La Strega della Spazzatura, equivocando la natura del loro rapporto, getta una maledizione su Sophie, trasformandola in una novantenne rugosa. Sophie va via di casa e girovaga in una distesa desolata dove per caso entra nel castello mobile di Howl. Nascondendo la sua identita\', diventa la donna delle pulizie. La vecchia petulante Sophie rimette a posto la casa, con molto piů brio di quanto ne avesse in origine. Cosa farà Sophie e cosa capiterà tra lei e Howl?', '2004-09-09', 'Released', 24000000, 236049757, NULL, NULL),
(7345, 'Il petroliere', 'There Will Be Blood', 158, '/djImsRRWpxOGxfSaTl1UWTf8ZoK.jpg', 'Daniel Plainview è un cercatore d\'argento che, alla fine dell\'800 trova il petrolio nell\'Ovest degli Stati Uniti. La sua ricchezza diventa considerevole, ma l\'uomo, sempre più accecato da una misantropia assoluta, allontanerà da sé anche il figlio, precipitando sempre più nell\'avidità del possesso.', '2007-12-26', 'Released', 25000000, 77208711, NULL, NULL),
(8077, 'Alien³', 'Alien³', 114, '/mZS4szrsrnGvWO5XL5BvXsURcgX.jpg', 'Siamo sul pianeta-penitenziario Fiorina 161, in un altro sistema solare. Qui naufraga il sottufficiale Ripley, insieme a un\'altra creatura simile agli Alien che aveva già combattuto in passato. La comunità che abita il pianeta non è però tecnologicamente preparata alla lotta con quella creatura e Ripley teme che il suo incubo non finirà mai.', '1992-05-22', 'Released', 50000000, 159773545, 8091, NULL),
(8078, 'Alien - La clonazione', 'Alien Resurrection', 109, '/6qOo8xQcWV4cTNDqTNyrakSoEbk.jpg', 'Duecento anni dopo essere morta, in un’astronave attrezzata a laboratorio Ellen Ripley (Sigourney Weaver) viene in qualche modo resuscitata grazie a un esperimento di clonazione. Ma le cose non sono così semplici e in Ripley si sono mescolate caratteristiche aliene. Oltre a ciò, Ripley si rende conto che lo scopo della sua resurrezione è quello di estrapolare la regina aliena che vive dentro di lei. A peggiorare le cose, le creature aliene allevate da scienziati privi di scrupoli scappano e cominciano a uccidere.', '1997-11-12', 'Released', 70000000, 162000000, 8091, NULL),
(8392, 'Il mio vicino Totoro', 'となりのトトロ', 86, '/86jZDyajHufXUuSFSASuXWOb5gJ.jpg', 'Le sorelline Satsuki e Mei si trasferiscono insieme al padre in una nuova casa in campagna. Per le due bambine inizia un viaggio alla scoperta di un nuovo mondo, abitato da creature fantastiche: dai nerini del buio, spiritelli della fuliggine, a buffi esseri di pelo di varie dimensioni, tra cui Totoro, lo spirito buono della foresta! Insieme a lui, Satsuki e la piccola Mei vivranno una magica e straordinaria avventura all’insegna dell’amicizia!', '1988-04-16', 'Released', 3700000, 45000000, NULL, NULL),
(8587, 'Il re leone', 'The Lion King', 89, '/ynzEis5NQxPv0cBrqxwRD5qJLol.jpg', 'Convinto di essere responsabile della morte del padre re Mufasa, il piccolo leoncino Simba si allontana dalla sua terra. Accolto e allevato dal suricato Timon e dal facocero Pumbaa, Simba cresce cercando di dimenticare il passato. È ritrovato da Nala, sua vecchia compagna di giochi, e Rafiki, babbuino sciamano, che lo convincono a tornare per scacciare l\'usurpatore Scar.', '1994-06-23', 'Released', 45000000, 763455561, 94032, NULL),
(9533, 'Red Dragon', 'Red Dragon', 124, '/2HqYhlDTc4GWY6XeXm99rvlorec.jpg', 'Tre anni dopo il suo ritiro dall\'FBI, l\'agente Will Graham viene contattato dal suo ex partner, per aiutarlo a risolvere un caso relativo ad un serial killer, noto come \"Lupo Mannaro\". Graham accetterà e chiederà aiuto ad Hannibal Lecter, suo vecchio  nemico, la cui cattura che aveva segnato la fine della sua carriera, nel 1988', '2002-10-02', 'Released', 78000000, 209196298, 9743, NULL),
(9732, 'Il re leone II - Il regno di Simba', 'The Lion King II: Simba\'s Pride', 81, '/jrnm47tOQLn6jNQYbIrCTI6Ggw4.jpg', 'Simba e Nala hanno una figlia, Kiara. Timo e Pumbaa sono incaricati di farle da babysitter ma la piccola scappa avventurandosi da sola nella terra proibita. Lì incontra Kovu, un cucciolo di leone, e i due diventano amici. Ciò che la piccola Kiara e la sua famiglia non sanno è che Kovu è il figlio di Zira, una seguace in esilio del defunto Scar. Il piano di Zira è quello di far diventare re suo figlio Kovu, soppiantando Simba.', '1998-10-24', 'Released', 0, 0, 94032, NULL),
(9740, 'Hannibal', 'Hannibal', 131, '/wWKMB2ZRVwKJWH4XsLt1XDxJOem.jpg', 'Sette anni sono passati da quando il Dott. Hannibal Lecter sfuggì alla sorveglianza, dieci anni da quando l\'agente FBI Clarice Starling lo intervistò nell\'ospedale di massima sicurezza per criminali psicotici. Ora il Dr. Lecter si trova a Firenze sotto falsa copertura, ma una sua vecchia viittima, rimasta sfigurata, si rifa viva per vendicarsi...', '2001-02-08', 'Released', 87000000, 351692268, 9743, NULL),
(10576, 'Psycho II', 'Psycho II', 113, '/yIwpEFGPp8X0RBC03mLUJClxXXE.jpg', 'Norman Bates, dopo aver passato 22 anni in un istituto di riadattamento (egli infatti era stato arrestato per gli omicidi commessi nel motel di sua proprietà e poi sottoposto a cure psichiche perché riconosciuto infermo di mente), torna a casa in quanto i medici lo dichiarano guarito: durante la seduta in tribunale, la sorella dell\'ultima sua vittima minaccia di vendicarsi poiché secondo lei egli è un assassino che non doveva essere rimesso in libertà. Lo psicanalista che ha facilitato l\'assoluzione di Norman lo accompagna a casa e poi al posto di lavoro che egli stesso gli ha trovato e cioè come aiutante in un ristorante del paese. Il primo impatto con la propria casa lasciata drammaticamente tanti anni prima è sconvolgente per il giovane, ma egli sembra superare il primo momento e pare ben disposto a lavorare...', '1983-06-03', 'Released', 5000000, 34725000, 119674, NULL),
(10681, 'WALL·E', 'WALL·E', 97, '/1ZkFCJwN6hNUdNZUIUCeugja06j.jpg', 'Wall-e è l\'ultimo robot rimasto sulla terra dopo che gli umani l\'hanno abbandonata perchè invasa dai rifiuti. Si sono dimenticati di spegnerlo e lui da 700 anni continua a fare quello per cui è stato costruito: comprimere e ammassare rifiuti. Non parla ma si fa capire molto bene a gesti e attraverso una gamma di suoni espressivi come faceva R2-D2 di Guerre Stellari. È un robot animato come un animale antropomorfo, un piccolo Charlot: operaio alienato che sogna un domani migliore guardando il cielo stellato. E quando dal cielo questo domani migliore arriva sotto forma di un altro robot, Eve, più moderno e programmato per cercare vita sulla Terra, Wall-e lo insegue sull\'astronave madre. Lì, sempre come il vagabondo di Chaplin, sarà un portatore sano e inconsapevole di caos e anarchia assieme agli altri \"devianti\" della società cioè i robot difettosi, l\'equivalente di quella famiglia di freak che erano i pesci da acquario con cui aveva a che fare Nemo.', '2008-06-22', 'Released', 180000000, 521311860, NULL, NULL),
(11216, 'Nuovo Cinema Paradiso', 'Nuovo Cinema Paradiso', 155, '/Q1t8Fg8xnRPMrPhm43IzZFX2lv.jpg', 'E\' la storia dell\'amicizia tra Alfredo, proiezionista del cinematografo parrocchiale del paesino di Giancaldo in Sicilia, e Salvatore, diventato poi da grande affermato regista a Roma. Alla notizia della morte di Alfredo, Salvatore ripercorre nella sua memoria i momenti più significativi di questa amicizia e decide di tornare al suo paese per i funerali.Ma tra le altre sorprese scoprirà che la sala del Nuovo Cinema Paradiso sta per essere abbattuta.', '1988-11-17', 'Released', 5000000, 11990401, NULL, NULL),
(11324, 'Shutter Island', 'Shutter Island', 138, '/1d5OayKwiupaGc0GTEemWWnhaFJ.jpg', 'Nel 1954, i due agenti federali Teddy Daniels e Chuck Aule vengono inviati con un battello a Shutter Island, a largo della costa est, per investigare sull\'improvvisa scomparsa di una pericolosa infanticida residente presso l\'istituto mentale Ashecliffe, Rachel Solando. Il direttore dell\'istituto, il dottor Cawley, e i vari infermieri sostengono che la madre assassina si sia come dileguata dalla sua stanza senza lasciare alcuna traccia, ma l\'agente Daniels pare nutrire fin dal principio dei forti sospetti sul modo di condurre l\'ospedale da parte del dottor Cawley e del suo medico assistente, il dottor Naehring. Un uragano costringe i due agenti a protrarre il soggiorno sull\'isola, durante il quale le indagini proseguono e particolari sempre più inquietanti emergono, mentre Daniels continua ad avere delle visioni che riguardano la moglie defunta e le sue esperienze di guerra contro gli ufficiali nazisti.', '2010-02-14', 'Released', 80000000, 294800000, NULL, NULL),
(11423, 'Memorie di un assassino', '살인의 추억', 129, '/n6GHqnUBV0R0MWof77slsHYXskF.jpg', 'In un villaggio nella provincia di Gyunggi viene rinvenuto il cadavere di una donna che prima di essere uccisa è stata stuprata. Due detectives locali si fanno carico del caso ma, sebbene non usino i guanti bianchi nel condurre le indagini, non arrivano a nulla. Ad aiutare l\'inesperta coppia arriva da Seul il collega Seo Tae-yoon, mentre altri omicidi commessi con lo stesso modus operandi cominciano a far pensare ad un serial killer…', '2003-05-02', 'Released', 2800000, 26000000, NULL, NULL),
(11430, 'Il re leone 3 - Hakuna Matata', 'The Lion King 1½', 77, '/c1BSU3OfjAmONF3saEGGcx9NHSl.jpg', 'Timon vive nella fossa della vergogna costretto, come la mamma, lo zio Max e le altre suricate, a scavare gallerie sotterranee per potersi nascondere dai predatori. Un giorno, nel tentativo di creare un lucernario per poter godere un po\' della luce solare, Timon provoca il crollo dell\'intera galleria. Si viene a sapere che si tratta della quarta galleria che fa crollare in una sola settimana. La mamma di Timon, resasi conto delle difficoltà del figlio nell\'abituarsi allo stile di vita delle suricate (che egli ritiene patetico e claustrofobico), lo convince a prestare servizio di guardia, permettendogli così di vivere all\'aria aperta. Anche a questo ruolo Timon si dimostra ben presto inadatto: vagheggiando una vita migliore, la maldestra sentinella si distrae e lascia campo libero alle iene, che attaccano le altre suricate. Nessuno rimane ucciso, tuttavia la colonia perde la poca fiducia che ancora nutriva verso Timon, che decide di andarsene di casa in cerca di una vita migliore.', '2004-02-06', 'Released', 0, 1465, 94032, NULL),
(11778, 'Il cacciatore', 'The Deer Hunter', 183, '/jzEI1i4kq2llejxhDETzk9GEBUJ.jpg', 'Tre giovani amici di origine ucraina, operai in un\'acciaieria di Clairton (Pennsylvania), partono per il Vietnam dopo aver festeggiato il matrimonio (rito ortodosso) di uno di loro. Catturati dai Vietcong, subiscono la tortura della roulette russa, ma riescono a fuggire. Mike (De Niro) rimpatria, carico di medaglie; Steven (Savage) perde le gambe e Nick (Walken) trova a Saigon la morte che aveva cercato con accanimento. All\'inferno e ritorno. Il Vietnam occupa la parte centrale e un breve capitolo (enfatico) verso la fine, in cadenze di un\'apocalisse allucinata, di un carnevale di morte.', '1978-03-09', 'Released', 15000000, 50000000, NULL, NULL),
(12444, 'Harry Potter e i Doni della Morte - Parte 1', 'Harry Potter and the Deathly Hallows: Part 1', 146, '/qvqfg5rnz1JWmT4CaJIeAA1EKI3.jpg', 'Dopo la tragica conclusione dell\'ultimo anno scolastico, gli alunni di Hogwarts si accingono a tornare a scuola. Ma questo non sarà un anno come gli altri per Harry, Ron e Hermione che si preparano a una pericolosissima missione: scoprire e distruggere il segreto dell\'immortalità di Voldemort, gli Horcrux. Senza la guida dei loro insegnanti e senza la protezione del professor Silente i tre amici dovranno fare affidamento l\'uno sull\'altro, ma le Forze Oscure metteranno a repentaglio la loro amicizia! Nel frattempo il mondo dei maghi è diventato un posto pericoloso per tutti i nemici del Signore Oscuro: la guerra a lungo temuta è scoppiata e i Mangiamorte di Voldemort hanno preso il controllo del Ministero della Magia e assalito Hogwarts. L\'unica speranza di Harry è intanto trovare l\'Hocrux prima di essere preso e catturato dalle creature oscure.', '2010-10-06', 'Released', 250000000, 954305868, 1241, NULL),
(12445, 'Harry Potter e i Doni della Morte - Parte 2', 'Harry Potter and the Deathly Hallows: Part 2', 130, '/xNCCG9bHted49BYFUlTkJq1sxbB.jpg', 'Occupati Hogwarts e il mondo della magia, Voldemort e i Mangiamorte hanno ormai un solo obiettivo: disperdere l\'esercito di Silente e uccidere Harry Potter, alla ricerca degli ultimi Horcrux. Individuati con l\'immancabile aiuto di Ron e Hermione gli oggetti e i soggetti viventi che contengono l\'anima frantumata e separata dal corpo del Signore Oscuro, i tre ragazzi hanno bisogno di tempo per raggiungere quelle schegge di anima e farne scempio. Ripiegati a Hogwarts, presieduta da Severus Piton e difesa dai dissennatori, Harry e compagni vengono accolti trionfalmente da Neville Paciock e il suo esercito di dissidenti. Nella furia della battaglia Harry scoprirà che tra il bianco di Silente e il nero di Piton esiste una zona grigia e una lacrima rivelatrice di ben altre verità. Recatosi al Pensatoio e versato il pianto e i ricordi di Piton, Harry saprà finalmente cosa fare per annullare Voldemort.', '2011-07-07', 'Released', 125000000, 1341511219, 1241, NULL),
(12477, 'La tomba delle lucciole', '火垂るの墓', 93, '/kwXG1DSpciHsBvcBojqMqGkU7pe.jpg', 'Giappone, 21 settembre 1945. Alla stazione di Kobe, il quattordicenne Seita muore di inedia. Il suo spirito ripercorre i tragici eventi degli ultimi quattro mesi: i bombardamenti americani, il cadavere della madre sfigurato dalle ustioni, il padre a difendere la gloria dell\'impero nella sua bianca uniforme da ufficiale di marina. E poi l\'orgoglio, la fuga, i furti, la fame. Questa notte spaventosa è rischiarata dai flebili bagliori delle lucciole. Ma all\'alba non ne rimarrà più nessuna.', '1988-04-16', 'Released', 3700000, 516962, NULL, NULL),
(12662, 'Psycho III', 'Psycho III', 93, '/oHjAphFdYVmQhmgNBHQ2CRJjsOf.jpg', 'Norman Bates ha ripreso il suo lavoro e si innamora di una ex-suora che contraccambia il suo amore. Ma esso sarà ostacolato di nuovo dall\'istinto di sdoppiare la sua personalità e a tenere il cadavere impagliato della madre che lo induce ad uccidere i suoi clienti fino ad uscire completamente di senno.', '1986-04-02', 'Released', 8400000, 14481606, 119674, NULL),
(13223, 'Gran Torino', 'Gran Torino', 116, '/eUepSGWIJjXeMAlSnk4CSZKOTfg.jpg', 'Walt Kowalski è un veterano della guerra in Corea e non sopporta che nell\'abitazione di fianco alla sua viva una famiglia di asiatici. Le uniche sue passioni, oltre alla birra, sono il suo cane e un\'auto modello Gran Torino, che viene sottoposta a continua manutenzione. La sua vita cambia il giorno in cui il giovane vicino Thao, spinto da una gang, si introduce nel suo garage. Walt lo fa fuggire, ma di lì a poco tempo assisterà a una violenta irruzione dei membri della gang con inatteso sconfinamento nella sua proprietà. In quell\'occasione sottrarrà Thao alla violenza del branco, ottenendo la riconoscenza della sua famiglia.', '2008-12-09', 'Released', 33000000, 269958228, NULL, NULL),
(16869, 'Bastardi senza gloria', 'Inglourious Basterds', 153, '/lBOCVkZm788NzSbQRSxgEksf69x.jpg', 'Nella Francia occupata dai nazisti, durante la Seconda Guerra Mondiale, Shosanna Dreyfus assiste all\'esecuzione della sua famiglia su ordine del colonnello nazista Hans Landa, ma riesce a fuggire a Parigi dove assume una nuova identità, come operatrice e titolare di un cinematografo. Nel frattempo, in un\'altra località europea, il tenente Aldo Raine si mette alla guida di un gruppo di soldati ebrei conosciuti dai loro nemici come I Bastardi. Insieme ai suoi uomini, Raine collabora con con l\'attrice tedesca Bridget Von Hammersmark, che in realtà è un agente segreto, in una missione speciale per rovesciare il Terzo Reich. Il loro destino si incrocerà con quello della Dreyfus, che tra l\'altro sta pianificando una vendetta personale.', '2009-08-19', 'Released', 70000000, 321457747, NULL, NULL),
(19404, 'Il coraggioso prenderà la sposa', 'दिलवाले दुल्हनिया ले जायेंगे', 190, '/2CAL2433ZeIihfX1Hb2139CX0pW.jpg', '', '1995-10-19', 'Released', 13200000, 100000000, NULL, NULL),
(24428, 'The Avengers', 'The Avengers', 143, '/mJwEvI0k75o1uRkd57ZbERazxzf.jpg', 'I supereroi più famosi si riuniscono in una squadra di personaggi Marvel leggendari come Iron Man, l\'incredibile Hulk, Thor, Captain America, Occhio di Falco e Vedova Nera. Quando la comparsa di un nemico inatteso minaccia la tranquillità e la sicurezza del mondo, Nick Fury, direttore dell\'agenzia internazionale per il mantenimento della pace conosciuta come S.H.I.E.L.D., si trova ad aver bisogno di una squadra che salvi il pianeta dall\'orlo del disastro. Inizia così, da un capo all\'altro della terra, un audace lavoro di reclutamento. Dopo aver riunito la squadra, Nick Fury e il suo fidato assistente, l\'Agente Coulson, dovranno convincere i supereroi a convivere e lavorare insieme, utilizzando i loro incredibili poteri contro il pericoloso Loki che è riuscito ad accedere al Tesseract e ai suoi poteri illimitati.', '2012-04-25', 'Released', 220000000, 1518815515, 86311, NULL),
(27205, 'Inception', 'Inception', 148, '/5QHWgqaBxZI1eM5e3YhyKzY5o3z.jpg', 'Dom Cobb possiede una qualifica speciale: è in grado di inserirsi nei sogni altrui per prelevare i segreti nascosti nel più profondo del subconscio. Viene contattato da Saito, un potentissimo industriale di origine giapponese, il quale gli chiede di tentare l\'operazione opposta. Non deve prelevare pensieri celati ma inserire un\'idea che si radichi nella mente di una persona. Costui è Robert Fischer Jr. il quale, alla morte dell\'anziano e dittatoriale genitore, dovrà convincersi che l\'unica cosa che può fare è distruggere l\'impero ereditato. Saito avrà allora campo libero. In cambio offrirà a Cobb la possibilità di rientrare negli Stati Uniti dove è ricercato per omicidio. Cobb accetta e si fa affiancare da un team di cui entra a far parte la giovane Ariane, architetto abilissimo nella costruzione di spazi virtuali.', '2010-07-15', 'Released', 160000000, 825532764, NULL, NULL),
(28178, 'Hachiko - Il tuo migliore amico', 'Hachi: A Dog\'s Tale', 94, '/ag59RClKGBa60Ymbcucr73394yV.jpg', 'Hachi è un cucciolo di razza Akita perduto sulla banchina di una stazione da un facchino sbadato. Approdato in America dal lontano Tibet, Hachi è raccolto dall\'abbraccio amorevole di Parker Wilson, insegnante di musica ispirato, marito e padre esemplare. Vincendo le resistenze della moglie, Parker lo accoglie nella sua casa e nella sua vita, scandita dai treni, quello delle otto e quello delle cinque. Hachi, deciso a non perdersi un respiro del suo padrone, lo accompagna ogni mattina al binario e lo attende ogni sera nel piazzale della stazione. Tra una partita degli Yankees e una pallina da baseball mai recuperata, Parker e Hachi condividono il divano, la vasca da bagno e le stagioni. Un avvenimento traumatico interromperà quel quotidiano (stra)ordinario ma non piegherà la fedeltà di Hachi verso l\'impegno preso. Aspettare il ritorno e le carezze di Parker.', '2009-06-08', 'Released', 16000000, 46749646, NULL, NULL),
(37165, 'The Truman Show', 'The Truman Show', 103, '/vniJPHHUpjdVPTSGxn6b3z93nyK.jpg', 'Truman Burbank nasce ripreso da una telecamera. Poi, per trent\'anni continuerà ad esser ripreso a sua insaputa da telecamere che lo seguiranno in ogni luogo della sua vita, per strada, al lavoro, a letto. Lui non lo sa, ma fa parte di uno show televisivo. Tutto ciò che c\'è intorno a lui è un set, le persone sono attori e comparse, le case, la polizia, i vigili del fuoco, tutto è set, persino l\'acqua del mare è fasulla. Sua moglie e il suo migliore amico sono attori. Sopra tutti c\'è Christof, dio-demiurgo-produttore, che gestisce la vita del poveretto. Naturalmente tutta l\'America impazzisce per il programma verità, in virtù della regola del voyeurismo, molla televisiva irresistibile. Poi Truman ha qualche sospetto, diventa sicuro del trucco e cerca di scappare più volte.', '1998-06-04', 'Released', 60000000, 264118201, NULL, NULL),
(40377, 'Psycho IV', 'Psycho IV: The Beginning', 96, '/vxWTkQRAvTvA6rbBhsdC4pdnHuq.jpg', 'In un programma radiofonico l\'argomento della serata è il matricidio, e a spiegare le cause di questo delitto intervengono uno psicologo specializzato e un matricida stesso. Ad ascoltare il programma è Norman Bates, che, preso il dovuto coraggio, alza la cornetta e telefona alla radio, dicendo inizialmentre di chiamarsi Ed. Norman esordisce con una frase piuttosto inquietante: \"Ho ucciso e sto per uccidere ancora\". Ovviamente alla radio prendono subito sul serio questa minaccia, e cercano di farlo parlare il più possibile, del suo passato, della prima volta che ha ucciso e di come lui abbia ucciso sua madre. L\'uomo ripercorre tutte le tappe della sua vita, da quando era bambino, dalla morte del padre, fino all\'adolescenza, quando ha cominciato a dare i primi segni di squilibrio.', '1990-11-10', 'Released', 800000, 0, 119674, NULL),
(49026, 'Il cavaliere oscuro - Il ritorno', 'The Dark Knight Rises', 165, '/4Op2hWPNa5JygwbmLs1O1pDAm7L.jpg', 'Sono passati otto anni da quando Batman è svanito nella notte, trasformandosi in un istante da eroe a fuggitivo. Prendendosi la colpa della morte del procuratore Harvey Dent, il Cavaliere oscuro ha sacrificato tutto per ciò che lui e il Commissario Gordon speravano fosse un bene superiore. Per un po’ di tempo la bugia ha funzionato e l’attività criminale di Gotham City è stata schiacciata dal peso della legge anti-criminale Dent Act. Ma tutto cambierà con l’arrivo di un’astuta ladra con un misterioso piano. Ma molto più pericoloso è l’arrivo di Bane, un terrorista mascherato i cui spietati piani per Gotham costringono Bruce a uscire dal suo esilio auto imposto. Ma anche se indossa di nuovo il mantello e il cappuccio, Batman potrebbe non essere così forte da fermare Bane.', '2012-07-16', 'Released', 250000000, 1081041287, 263, NULL),
(50014, 'The Help', 'The Help', 146, '/2v6g7d0dhoBO8GeY51zZTUGNxB4.jpg', 'Nel Mississippi, durante gli anni Sessanta, Eugenia Skeeter Phelan dopo aver terminato gli studi ha l’intenzione di divenire un giorno scrittrice e raccontare la storia delle discriminazioni razziali a cui sono costrette le donne di colore che, come Aibileen e Minnie, da sempre si prendono cura delle famiglie della zona. La ragazza rivoluzionerà con le sue interviste per un libro la vita di amici e concittadini, costretti a rivedere le loro ataviche convinzioni, di cui la portavoce per eccellenza è Hilly Holbrook, reginetta dei salotti borghesi.', '2011-08-09', 'Released', 25000000, 216639112, NULL, NULL),
(60935, 'La cosa', 'The Thing', 103, '/gWkYBw4VL6iAvsmvh8JdQK18cjM.jpg', 'La paleontologa Kate Lloyd raggiunge un team di scienziati norvegesi i quali hanno trovato, nascosta tra i ghiacci, una base sotterranea di origine sconosciuta e, poco distante, il corpo di un alieno conservato dal gelo. Una volta trasportato alla base il corpo si rianima e gli umani scoprono ben presto che la terrificante creatura è in grado di prendere possesso dei corpi dei terrestri mantenendone le sembianze e infiltrandosi quindi nel gruppo. Da quel momento tutti prendono a sospettare di tutti. Sarà Kate a dover prendere il controllo della situazione escogitando strategie per far emergere i ‘falsi umani\' ed eliminarli.', '2011-10-12', 'Released', 35000000, 31505287, 479888, NULL),
(68718, 'Django Unchained', 'Django Unchained', 165, '/3Q41QdROiYoEMY0qXhfRMT5DbPd.jpg', 'Stati Uniti del Sud, alla vigilia della guerra civile. Il cacciatore di taglie di origine tedesca dottor King Schultz, su un carretto da dentista, è alla ricerca dei fratelli Brittle, per consegnarli alle autorità piuttosto morti che vivi e incassare la ricompensa. Per scovarli, libera dalle catene lo schiavo Django, promettendogli la libertà a missione completata. Tra i due uomini nasce così un sodalizio umano e professionale che li conduce attraverso l\'America delle piantagioni e degli orrori razzisti alla ricerca dei criminali in fuga e della moglie di Django, Broomhilda, venduta come schiava a qualche possidente negriero.', '2012-12-25', 'Released', 100000000, 425368238, NULL, NULL),
(77338, 'Quasi amici - Intouchables', 'Intouchables', 113, '/f77ZsUPqTLHCLXtRgZNVKJE0S7a.jpg', 'La vita derelitta di Driss, tra carcere, ricerca di sussidi statali e un rapporto non facile con la famiglia, subisce un\'impennata quando, a sorpresa, il miliardario paraplegico Philippe lo sceglie come proprio aiutante personale. Incaricato di stargli sempre accanto per spostarlo, lavarlo, aiutarlo nella fisioterapia e via dicendo Driss non tiene a freno la sua personalità poco austera e contenuta. Diventa così l\'elemento perturbatore in un ordine alto borghese fatto di regole e paletti, un portatore sano di vitalità e scurrilità che stringe un legame di sincera amicizia con il suo superiore, cambiandogli in meglio la vita.', '2011-11-02', 'Released', 13000000, 426588510, NULL, NULL),
(87101, 'Terminator Genisys', 'Terminator Genisys', 126, '/sfB3zjtI9dkDBGcpNd5XKKer7gr.jpg', 'Nel 2029, John Connor, capo della resistenza umana, conduce la guerra contro le macchine. All\'offensiva di Los Angeles, i timori di John sul futuro sconosciuto cominciano a emergere quando l\'uomo viene informato dalla sua unità, la Tech-Com, che Skynet attaccherà da due fronti, passato e futuro, cambiando la guerra per sempre.  Per poter vincere la guerra contro Skynet, Connor manda il suo fido luogotenente Kyle Reese indietro nel tempo per salvare la vita di sua madre e garantire la propria esistenza. Tuttavia, Kyle scopre che il passato originale è cambiato. In questa linea temporale, un Terminator era stato inviato indietro nel tempo per uccidere Sarah Connor da bambina, e così la resistenza aveva inviato un proprio cyborg indietro nel tempo per proteggerla. Dopo che l\'assassino aveva ucciso i suoi genitori, il T-850 riprogrammato l\'aveva cresciuta e addestrata ad affrontare il suo destino, che lei cerca di rifiutare categoricamente.', '2015-06-23', 'Released', 155000000, 440603537, 528, NULL),
(99861, 'Avengers: Age of Ultron', 'Avengers: Age of Ultron', 141, '/jm6lX35DkZRtyf0rNGQUIBLFoBa.jpg', 'Quando Tony Stark riprende un programma di mantenimento della pace in disuso, qualcosa va storto e la squadra degli eroi più potenti della Terra composta da Iron Man, Captain America, Thor, l’Incredibile Hulk, Vedova Nera e Occhio di Falco, sarà messa a dura prova per salvare il mondo da un destino inesorabile. Toccherà agli Avengers far fronte al malvagio Ultron e impedirgli di portare a compimento i suoi terribili piani. Nuove e scomode alleanze ed eventi imprevisti daranno vita a una straordinaria ed epica avventura', '2015-04-22', 'Released', 365000000, 1405403694, 86311, NULL),
(103663, 'Il sospetto', 'Jagten', 115, '/foPpZ01yEQFl4qpFfQmy5xaMv84.jpg', 'Dopo un difficile divorzio, il quarantenne Lucas ha una nuova compagna e un nuovo lavoro, e sta finalmente recuperando il rapporto col figlio adolescente, Marcus. Ma qualcosa va storto. Durante le feste natalizie, una storia inventata, una bugia qualsiasi si diffonde come un virus. Lo shock e i sospetti prendono il sopravvento e la piccola comunità viene travolta da un’ondata di isteria collettiva, mentre Lucas combatte una battaglia solitaria per difendere la sua vita e la sua dignità.', '2012-10-25', 'Released', 3800000, 18309793, NULL, NULL),
(106646, 'The Wolf of Wall Street', 'The Wolf of Wall Street', 180, '/hwg3pXw2m4HfRGbyRMIP8laf5Lf.jpg', 'Basato su una storia vera, The Wolf of Wall Street segue l’impressionante ascesa e la caduta di Jordan Belfort (interpretato dal tre volte candidato all’Academy Award® Leonardo DiCaprio), il broker di New York che conquista una fortuna incredibile truffando milioni di investitori. Il film segue la folle cavalcata di Belfort, un giovane “nuovo arrivato” a Wall Street che si trasforma via via in un corrotto manipolatore dei mercati e in un cowboy della Borsa. Avendo conquistato rapidamente una ricchezza enorme, Jordan la utilizza per comprarsi un’infinita gamma di afrodisiaci: donne, cocaina, automobili, la moglie supermodella e una vita leggendaria fatta di aspirazioni e acquisti senza limiti. Ma mentre la società di Belfort, la Stratton Oakmont, è sulla cresta dell’onda e sguazza nella gratificazione edonistica più estrema, la SEC e l’FBI tengono d’occhio il suo impero contrassegnato dagli eccessi.', '2013-12-25', 'Released', 100000000, 392000000, NULL, NULL),
(120467, 'Grand Budapest Hotel', 'The Grand Budapest Hotel', 99, '/tY8gmrOOzhJxfBLQNOxjbuSR52b.jpg', 'Una ragazza depone una chiave di una stanza d\'hotel ai piedi del busto dedicato a uno scrittore scomparso. Lo stesso scrittore racconta delle origini del suo romanzo. Un uomo oramai anziano e stanco racconta in un albergo semi deserto ad un giovane scrittore la storia di Gustave H., il leggendario concierge del Grand Budapest Hotel, e del suo giovane protetto Zero, alle prese con il furto e il recupero di un dipinto rinascimentale inestimabile e la battaglia per un enorme patrimonio di famiglia.', '2014-02-26', 'Released', 30000000, 174600318, NULL, NULL),
(140607, 'Star Wars: Il risveglio della Forza', 'Star Wars: The Force Awakens', 135, '/jw8Wb7Mx1o1uJSrUuOW4p16rlJu.jpg', 'Sono trascorsi circa trent\'anni dalla caduta dell\'Impero. L\'indipendente e solitaria Riley (Daisy Ridley), il soldato pentito Finn (John Boyega) e il pilota di caccia Poe (Oscar Isaac), danno inizio a una nuova grande avventura contro i cattivi dediti al Lato Oscuro della Forza, tra cui il minaccioso Kylo Ren (Adam Driver). Lungo la strada incontreranno nuovi amici, nemici e volti noti, come quello di Ian Solo (Harrison Ford) e della principessa Leila (Carrie Fisher), divenuta un generale.', '2015-12-15', 'Released', 245000000, 2068223624, 10, NULL);
INSERT INTO `film` (`id`, `titolo`, `titolo_originale`, `durata`, `copertina`, `descrizione`, `data_rilascio`, `stato`, `budget`, `incassi`, `collezione`, `voto`) VALUES
(146233, 'Prisoners', 'Prisoners', 153, '/tJE5Xs8Z1ZQPNBv71AWZ95L1o6C.jpg', 'Nella (apparentemente) tranquilla provincia americana due bambine di sei e sette anni, Anna ed Eliza, escono a giocare insieme e svaniscono senza lasciare traccia. I genitori, fra di loro amici, reagiscono nei modi più disparati (e disperati): Keller, il padre della piccola Anna, comincia una caccia all\'uomo senza esclusione di colpi, mentre sua moglie Grace si imbottisce di psicofarmaci per attutire il dolore e lo sgomento; Franklin, il padre di Eliza, cerca di non farsi travolgere dalla sete di giustizia di Keller, la moglie Nancy invece pare disposta ad appoggiarne i modi estremi.  Il detective Loki avvia le sue indagini fra intoppi burocratici e depistaggi, e comincia a chiedersi di chi sospettare, dato che anche il comportamento di Keller si fa sempre più equivoco. E la cittadina di provincia rivela di avere più scheletri in cantina (letteralmente) di quanto si potesse immaginare.', '2013-09-18', 'Released', 46000000, 122126687, NULL, NULL),
(157336, 'Interstellar', 'Interstellar', 169, '/9PTvvflydmTnfvMWMAwMMkV7X2s.jpg', 'In seguito alla scoperta di un cunicolo spazio-temporale, un gruppo di esploratori si avventura in una eroica missione per tentare di superare i limiti della conquista spaziale e oltrepassare le distanze che fino a quel momento avevano reso impraticabili i viaggi interstellari. L\'obiettivo è quello di trovare nuovi luoghi dove coltivare il granoturco, l\'unica coltivazione rimasta dopo un drastico cambiamento climatico che ha colpito soprattutto l\'agricoltura.', '2014-11-05', 'Released', 165000000, 701729206, NULL, NULL),
(181808, 'Star Wars: Gli ultimi Jedi', 'Star Wars: The Last Jedi', 150, '/8qOzSPUWlBGfteuKFWJJTRpiFxI.jpg', 'Mentre il Primo Ordine si prepara a stroncare quel che resta della Resistenza, Rey consegna a Luke Skywalker la spada laser che fu sua, invitandolo a interrompere il suo esilio per salvare il mondo libero. Ma Luke non ne vuole sapere e il Lato Oscuro tesse la sua trama letale attorno agli ultimi ribelli.', '2017-12-13', 'Released', 200000000, 1332698830, 10, NULL),
(181812, 'Star Wars: L\'ascesa di Skywalker', 'Star Wars: The Rise of Skywalker', 142, '/3drtqLOARQEuFgEmGRlMlWpV3Eb.jpg', 'La resistenza è ridotta a poche unità, il primo ordine dilaga sotto il comando del leader supremo Kylo Ren, ma un messaggio ha turbato la galassia. L\'imperatore Palpatine giura vendetta! Ren si mette così alla ricerca dell\'origine della trasmissione e arriva a confrontarsi con Palpatine, che gli offre una spaventosa flotta se saprà eliminare la ragazza Jedi, Rey. Questa combatte e si addestra seguendo gli insegnamenti del generale Organa, mentre Finn, Poe e Chewbacca ricevono messaggi da una spia nel Primo Ordine.', '2019-12-18', 'Released', 250000000, 1074144248, 10, NULL),
(205596, 'The Imitation Game', 'The Imitation Game', 114, '/5Uc82xW62CoDMbSvcopOq5Zn6uK.jpg', 'Manchester, primi anni \'50. Alan Turing, brillante matematico ed esperto di crittografia, viene interrogato dall\'agente di polizia che lo ha arrestato per atti osceni. Turing inizia a raccontare la sua storia partendo dall\'episodio di maggiore rilevanza pubblica: il periodo, durante la Seconda Guerra Mondiale, in cui fu affidato a lui e ad un piccolo gruppo di cervelloni, fra cui un campione di scacchi e un\'esperta di enigmistica, il compito di decrittare il codice Enigma, ideato dai Nazisti per comunicare le loro operazioni militari in forma segreta. È il primo di una serie di flashback che scandaglieranno la vita dello scienziato morto suicida a 41 anni e considerato oggi uno dei padri dell\'informatica in quanto ideatore di una macchina progenitrice del computer.', '2014-11-14', 'Released', 14000000, 233555708, NULL, NULL),
(244786, 'Whiplash', 'Whiplash', 107, '/4j35IGVmDArteUFxeTI95tFyLkA.jpg', 'Andrew studia batteria jazz nella più prestigiosa ed importante scuola di musica di New York, è al suo primo anno e già viene notato da Terence Fletcher, temutissimo e inflessibile insegnante che a sorpresa lo vuole nella propria band. Il ragazzo è eccitato dalla possibilità ma non sa che in realtà sarà un inferno di prove, esercizi e umiliazioni come non pensava fosse possibile. Gli standard richiesti da Fletcher sono mostruosi e progressivamente alienano sempre di più Andrew dalle altre parti della sua vita.', '2014-10-10', 'Released', 3300000, 13092000, NULL, NULL),
(264644, 'Room', 'Room', 118, '/mNm1N9fvXKi0btgdj9MS3h4osBu.jpg', 'Room racconta la straordinaria storia di Jack, un bambino vivace di 5 anni che viene accudito dalla sua amorevole e devota Ma\' (Brie Larson, vincitrice dell\'Oscar 2016 come migliore attrice protagonista). Come ogni buona madre, Ma\' fa di tutto affinché Jack sia felice ed al sicuro, ricoprendolo d\'amore e calore e passando il tempo a giocare e raccontare storie. La loro vita però, è tutt\'altro che normale - sono intrappolati- confinati in uno spazio senza finestre di 3 metri x 3, che Ma\' eufemisticamente chiama \"Stanza\". All\'interno di questo ambiente Ma\' crea un intero universo per Jack, e fa qualsiasi cosa per garantire al figlioletto una vita normale ed appagante anche in un luogo così infido. Ma di fronte ai crescenti interrogativi di Jack circa la loro situazione, e la ormai debole resistenza di Ma\', decidono mettere in atto un piano di fuga molto rischioso, che potrebbe metterli però di fronte ad una realtà ancora più spaventosa: il mondo reale.', '2015-10-16', 'Released', 13000000, 35401758, NULL, NULL),
(265177, 'Mommy', 'Mommy', 139, '/3zyQtPg3avKprmJP2gBiYgyWUQC.jpg', 'Diane è una madre single, una donna dal look aggressivo, ancora piacente ma poco capace di gestire la propria vita. Sboccata e fumantina, ha scarse capacità di autocontrollo e ne subisce le conseguenze. Suo figlio è come lei ma ad un livello patologico, ha una seria malattia mentale che lo rende spesso ingestibile (specie se sotto stress), vittima di impennate di violenza incontrollabili che lo fanno entrare ed uscire da istituti. Nella loro vita, tra un lavoro perso e un improvviso slancio sentimentale, si inserisce Kyle, la nuova vicina balbuziente e remissiva che in loro sembra trovare un inaspettato complemento.', '2014-09-19', 'Released', 4900000, 3494070, NULL, NULL),
(290098, 'Mademoiselle', '아가씨', 144, '/1oAhyXfE3ytjS6PxUjg5Yx2DtO8.jpg', 'La giovane ereditiera Hideko, alle soglie della maggiore età, è orfana di entrambi i genitori ed ha perso una zia, sorella della madre, cui era particolarmente legata. Vive quasi reclusa nella grande villa dello zio, un ricco collezionista di libri erotici che intende sposarla per impadronirsi del suo patrimonio.  Uno spregiudicato truffatore, che da tempo si fa chiamare Conte Fujiwara millantando origini nobiliari, riesce a far assumere come domestica di Hideko l\'abile borseggiatrice Sook-hee. Egli intende servirsi della ragazza per scardinare l\'equilibrio della casa, sposare Hideko, mettere le mani sul suo patrimonio e infine sbarazzarsene, rinchiudendola in manicomio.', '2016-06-01', 'Released', 8575000, 37767206, NULL, NULL),
(290859, 'Terminator - Destino oscuro', 'Terminator: Dark Fate', 128, '/5cl0EVRQYMe69T1FVKOKgLweX8V.jpg', 'Sarah Connor, ormai esperta cacciatrice di macchine, si ritrova a dover salvare una ragazza di nome Dani Ramos. A dare la caccia alla giovane è un nuovo modello di cyborg, inviato dal futuro da Skynet. La resistenza ha incaricato un\'ibrida metà umana e metà cyborg di nome Grace, di proteggere Dani. Nonostante i geni potenziati di Grace e le svariate armi di Sarah, le due non riescono ad abbattere il temibile cyborg e l\'unica via di salvezza sembra essere la fuga. Ma non si può scappare per sempre: le donne si vedono allora costrette a rivolgersi al \"vecchio\" modello di Terminator, il T-800, l\'unico che può provare ad aiutarle a salvare non solo la giovane ma anche il futuro.', '2019-10-23', 'Released', 185000000, 261119292, 528, NULL),
(299534, 'Avengers: Endgame', 'Avengers: Endgame', 181, '/8miyORCKx1lMYtc5YmqHyiVLwDF.jpg', 'In seguito alle azioni di Thanos nel precedente Avengers: Infinity War la popolazione dell\'intero universo è stata dimezzata e tra i caduti c\'è stato anche Nick Fury. Ma prima di morire questi è riuscito a lanciare un messaggio nello spazio alla potentissima Capitan Marvel, che tornata sulla Terra e di fronte a un gruppo di Avengers afflitto dalla sconfitta e dal lutto, vuole prendere le cose in mano. Quello che ha fatto Thanos però non si può risolvere con la semplice superforza e i colpi di energia...', '2019-04-24', 'Released', 356000000, 2797800564, 86311, NULL),
(299536, 'Avengers - Infinity War', 'Avengers: Infinity War', 156, '/A404e70ZnvWFoWA517sySQXe8X6.jpg', 'Dalla nascita dell\'universo, sei gemme elementari rappresentano i vari aspetti fondamentali del cosmo e chi le possedesse tutte raggiungerebbe l\'onnipotenza. È questo l\'obiettivo di Thanos, il titano pazzo che ritiene se stesso come un correttivo alla sovrappopolazione universale e pensa di essere una misura necessaria e giusta, persino benevola, mentre agli altri il suo operato appare, correttamente, come una serie di genocidi. Gli Avengers e i Guardiani della Galassia dovranno cercare di fermarlo, ma come se non bastasse la sua inarrestabile potenza ci sono dalla sua armate aliene e quattro letali \"figli\", ognuno deciso a consegnargli le gemme dell\'infinito.', '2018-04-25', 'Released', 300000000, 2046239637, 86311, NULL),
(315635, 'Spider-Man: Homecoming', 'Spider-Man: Homecoming', 133, '/ttJkhQxKoWkfenJb5GyKSV1lGxY.jpg', 'Peter Parker non riesce a scrollarsi di dosso quanto sia stata incredibile la sua esperienza con gli Avengers in Captain America: Civil War, l\'aver conosciuto Tony Stark e avere mantenuto con lui un rapporto speciale, tanto da avere un contatto diretto attraverso il suo assistente Happy Hogan e da aver ricevuto in dono un super-costume. Peter è così innamorato dell\'idea di diventare un Avenger da lasciar scivolare in secondo piano anche la ragazza che gli fa battere il cuore, la bella Liz, per andare dietro ai criminali e mostrarsi pronto per la posizione in squadra.', '2017-07-05', 'Released', 175000000, 880166924, 531241, NULL),
(324786, 'La battaglia di Hacksaw Ridge', 'Hacksaw Ridge', 139, '/gPV8lFaNTgd6ifw1fWEvoIsWnRq.jpg', 'Nel film viene raccontata  la storia vera di Desmond Doss.\r L\'attacco alla base americana di Pearl Harbor apre un nuovo fronte delle ostilità in Giappone. Desmond Doss, cresciuto sulle montagne della Virginia e in una famiglia vessata da un padre alcolizzato, decide di arruolarsi e di servire il suo Paese. Ma Desmond non è come gli altri. Cristiano avventista e obiettore di coscienza, il ragazzo rifiuta di impugnare il fucile e uccidere un uomo. Fosse anche nemico. In un mondo dilaniato dalla guerra, Desmond ha deciso di rimettere assieme i pezzi. Arruolato come soccorritore medico e spedito sull\'isola di Okinawa combatterà contro l\'esercito nipponico, contro il pregiudizio dei compagni e contro i fantasmi di dentro che urlano più forte nel clangore della battaglia.', '2016-10-07', 'Released', 40000000, 175302354, NULL, NULL),
(324857, 'Spider-Man - Un nuovo universo', 'Spider-Man: Into the Spider-Verse', 117, '/ebiu13XGsOfMvIUPA2oSrpNtnqQ.jpg', 'Miles Morales è un ragazzo afro-ispanico di New York che è appena entrato in una scuola relativamente esclusiva, dove però si sente fuori luogo. Qui infatti non conosce nessuno e suo padre, un poliziotto che detesta Spider-Man, non lo aiuta mettendolo in imbarazzo. Miles si rifugia dallo zio, che asseconda invece la sua passione da street artist, ma durante una escursione nei sotterranei di New York Miles viene morso da un ragno radioattivo. Il giorno dopo, sconvolto da sorprendenti poteri che somigliano a quelli di Spider-Man, torna a cercare il ragno e finisce per assistere a uno scontro tra l\'eroe e vari villain, durante il quale un esperimento per aprire un varco dimensionale ha effetti imprevisti. Presto Miles scoprirà che non c\'è un solo Uomo Ragno!', '2018-12-06', 'Released', 90000000, 375540831, 573436, NULL),
(334543, 'Lion - La strada verso casa', 'Lion', 118, '/k67qFl6nBlewk4EuMVhMuYMqjPC.jpg', 'Saroo, un bambino di cinque anni, è da solo e, spaventato e confuso, si ritrova dopo un lungo viaggio in treno nella caotica Calcutta, lontano un migliaio di miglia da casa. Cercando di sopravvivere alla vita di strada, finisce per essere adottato da una coppia di australiani che lo cresce con amore a Hobart. Non volendo ferire i sentimenti dei genitori adottivi, Saroo seppellisce il suo passato e il desiderio di ritrovare la madre e il fratello biologici. Un incontro casuale però riporterà a galla il suo sogno, facendolo imbarcare in una delle più grandi avventure della sua vita.', '2016-11-24', 'Released', 12000000, 140312928, NULL, NULL),
(335797, 'Sing', 'Sing', 108, '/fSLQa1RcnuStfA7z5KNAd2hEbwM.jpg', 'Il koala Buster Moon si è innamorato del teatro all\'età di sei anni e al teatro ha dedicato la sua vita. Ha anche accumulato una discreta serie di fiaschi e di debiti e ora è ricercato dalla banca a cui ha chiesto un prestito e dai macchinisti che reclamano lo stipendio. Come salvare capra e cavoli? Buster ha un\'idea geniale: un talent show. Apre quindi le porte del suo teatro ad una lunga fila di aspiranti cantanti e performer e sceglie i suoi gioielli: Rosita, maialina madre di 25 figli piccoli, Mike, topino vanitoso e vocalist d\'eccezione, Ash, porcospina dal cuore rock e Johnny, scimmione dall\'animo blues. Ci sarebbe anche Meena, elefantina portentosa, apparentemente troppo timida per esibirsi in pubblico…', '2016-11-23', 'Released', 75000000, 634151679, 544670, NULL),
(337404, 'Crudelia', 'Cruella', 134, '/y87a7TCp0SIHE2YXfyS0dN8Tghk.jpg', 'L\'adolescente Estella ha un sogno. Desidera diventare una stilista, essendo dotata di talento, innovazione e ambizione in egual misura. Ma la vita sembra intenzionata ad assicurarsi che i suoi sogni non si avverino mai. Dopo essere finita senza un soldo e rimasta orfana a Londra a dodici anni, quattro anni dopo Estella corre selvaggia per le strade della città con i suoi migliori amici e compagni di criminalità, Gaspare e Orazio, due ladri dilettanti. Quando un incontro casuale porta Etsella nel mondo dei giovani ricchi e famosi, tuttavia, inizia a mettere in discussione l\'esistenza che si è costruita per se stessa a Londra e si chiede se, dopotutto, potrebbe essere destinata a qualcosa di più. Quando una rockstar emergente incarica Estella di disegnargli un pezzo caratteristico, inizia a sentirisi come se fosse davvero arrivata.', '2021-05-26', 'Released', 200000000, 233503234, 837007, NULL),
(354912, 'Coco', 'Coco', 109, '/l5qUox5uroubMi8sihD9RGPbcwO.jpg', 'Coco racconta la storia del giovane Miguel che sogna di diventare un celebre musicista come il suo idolo Ernesto de la Cruz ma non capisce perché in famiglia sia severamente bandita qualsiasi forma di musica, da generazioni. Desideroso di dimostrare il proprio talento, a seguito di una misteriosa serie di eventi Miguel finisce per ritrovarsi nella sorprendente e variopinta Terra dell’Aldilà. Lungo il cammino, si imbatte nel simpatico e truffaldino Hector; insieme intraprenderanno uno straordinario viaggio alla scoperta della storia, mai raccontata, della famiglia di Miguel.', '2017-10-27', 'Released', 175000000, 800526015, NULL, NULL),
(359724, 'Le Mans \'66 - La grande sfida', 'Ford v Ferrari', 152, '/nKVOiiCukJsXNYPETbIWqZaBYd.jpg', 'Carroll Shelby è il pilota che nel \'59 ha vinto la 24 ore di Le Mans, la più ardua delle gare automobilistiche. Quando scopre di non poter più correre per una grave patologia cardiaca si dedica a progettare e vendere automobili. Con lui c\'è il suo fedele amico e collaudatore Ken Miles, dotato di uno spiccato talento per la guida, ma anche di un carattere complicato. Insieme accetteranno la sfida targata Ford di sconfiggere la Ferrari e si batteranno per vincere una nuova 24 ore di Le Mans, contro tutti, a bordo di un nuovo veicolo messo a punto da loro stessi.', '2019-11-13', 'Released', 97600000, 225508210, NULL, NULL),
(359940, 'Tre manifesti a Ebbing, Missouri', 'Three Billboards Outside Ebbing, Missouri', 115, '/4BLkWnNHwGdcwkivXHBTuOH1hEO.jpg', 'Sono passati mesi e l’omicidio di sua figlia è rimasto irrisolto, così Mildred Hayes decide di smuovere le autorità, commissionando tre manifesti alle porte della sua città, ognuno dei quali grida un messaggio provocatorio e preciso,  diretti a William Willoughby il venerato capo della polizia locale. Quando viene coinvolto anche il suo secondo ufficiale, Dixon, ragazzo immaturo e dal temperamento violento, la battaglia tra Mildred e le forze dell’ordine di Ebbing è dichiaratamente aperta.', '2017-12-01', 'Released', 15000000, 160192031, NULL, NULL),
(361743, 'Top Gun: Maverick', 'Top Gun: Maverick', 131, '/keAFiVKfJGXENjmSjsSG5blbWJ0.jpg', 'Dopo più di trent’anni di servizio nella Marina, il Tenente Pete “Maverick” Mitchell è proprio dove vorrebbe essere: un pilota coraggioso che può spingersi oltre ogni limite, cercando di schivare l’avanzamento di carriera che metterebbe un freno alla sua libertà. Quando viene ri-chiamato ad addestrare i migliori allievi Top Gun per una missione specializzata che nessuno al mondo ha mai portato a compimento, Maverick incontra il Tenente Bradley Bradshaw, nome in codice “Rooster”: è il figlio di Nick , il compianto “Goose.” Alle prese con un futuro incerto e con i fantasmi del passato, Maverick deve confrontarsi con le sue paure più profonde, fino ad una missione che richiederà il sacrificio ultimo di quelli che sceglieranno di parteciparvi.', '2022-05-24', 'Released', 170000000, 1482656000, 531330, NULL),
(372058, 'Your Name.', '君の名は。', 106, '/z26TZXh7lqrRVCIy1HXTTz3Fu2X.jpg', 'Mitsuha è una studentessa che vive in una piccola città rurale e desidera trasferirsi a Tokyo, nella grande metropoli dove ogni sogno si può realizzare. Taki è uno studente di liceo che vive proprio a Tokyo, ha un lavoro part-time in un ristorante italiano, ma vorrebbe lavorare nel campo dell’arte o dell’architettura. Una notte, Mitsuha sogna di essere un giovane uomo, si ritrova in una stanza che non conosce, ha nuovi amici e lo skyline di Tokyo si apre dinnanzi al suo sguardo. Nello stesso momento Taki sogna di essere una ragazzina che vive in una piccola città di montagna che non ha mai visitato. Ma quale sarà il segreto che si cela dietro questi strani sogni incrociati?', '2016-08-26', 'Released', 0, 357986087, NULL, NULL),
(378064, 'La forma della voce', '映画 聲の形', 129, '/kebTSlQRdLCh8sLqkh0B0KaR8i.jpg', 'Ogaki. Il liceale Shoya Ishida sta per saltare dal ponte per suicidarsi, ma all\'ultimo desiste. Cinque anni prima, ai tempi della scuola elementare, nella classe di Shoya arriva Shoko Nishimiya, una ragazza sordomuta: l\'accoglienza dei suoi compagni da timida diviene in breve tempo ostile. Per quanto Shoko si sforzi di essere gentile e disponibile con tutti, un gruppetto, capitanato da Shoya, si accanisce contro di lei. Cinque anni dopo Shoya ancora non è in grado di darsi pace per i torti inflitti a Shoko, anche perché la conseguenza delle sue azioni passate è la totale solitudine.', '2016-09-17', 'Released', 0, 30156463, NULL, NULL),
(381284, 'Il diritto di contare', 'Hidden Figures', 127, '/d6JTN9J9cAwCLDS37FsXTXbl1OQ.jpg', 'Katherine Johnson, Dorothy Vaughn e Mary Jackson sono tre donne afro-americane. Lavorano alla Nasa e sono le menti brillanti che hanno messo a punto il primo programma di missioni spaziali che ha portato uomini come l\'astronauta John Glenn in orbita. Il loro operato, basato sull\'elaborazione di importanti dati matematici, ha contribuito a ridare nuova fiducia alla nazione, ridefinire la corsa nello spazio e stupire il mondo. Da visionarie quali sono, hanno avuto la meglio sugli stereotipi di genere e razza, divenendo fonte di ispirazione per le giovani generazioni.', '2016-12-10', 'Released', 25000000, 230698791, NULL, NULL),
(398818, 'Chiamami col tuo nome', 'Call Me by Your Name', 130, '/mZ4gBdfkhP9tvLH1DO4m4HYtiyi.jpg', 'Nel 1983, una calda estate segna per sempre la vita del diciassettenne Elio, un musicista più colto e sensibile dei suoi coetanei, che ogni estate trascorre le vacanze nella villa di famiglia. Il padre, un professore universitario, come ogni anno ospita uno studente straniero per lavorare alla sua tesi di post dottorato. L\'arrivo di Oliver, ventiquattrenne statunitense, per la sua bellezza e i modi disinvolti, sconvolge la vita di Elio, che se ne innamora immediatamente. Tra lunghe passeggiate, nuotate e discussioni, tra i due giovani nasce un desiderio travolgente e irrefrenabile.', '2017-09-01', 'Released', 4000000, 41063475, NULL, NULL),
(400928, 'Gifted - Il dono del talento', 'Gifted', 101, '/dNfPsLB2NlZJbPUT7D1WwehPpmS.jpg', 'Frank Adler è un uomo che cresce da solo la prodigiosa nipotina Mary in una città costiera della Florida. I piani di Frank per garantire un\'educazione normale a Mary vanno in fumo quando le incredibili capacità matematiche della piccola vengono scoperte da sua madre Evelyn, i cui progetti rischieranno di separare per sempre zio e nipote.', '2017-04-12', 'Released', 7000000, 40343446, NULL, NULL),
(406997, 'Wonder', 'Wonder', 113, '/9pMD8L0vEn5cgreXFX6IVinwzhs.jpg', 'Nato con un\'anomalia facciale che non gli ha mai consentito di frequentare una scuola normale, Auggie Pullman diventa il più improbabile degli eroi quando viene ammesso all\'ultimo anno delle elementari. Mentre la sua famiglia, i suoi nuovi compagni di classe e tutta la comunità lotta per scoprire la propria compassione e accettazione, la straordinaria storia di Auggie unirà tutti quanti e dimostrerà che non occorre nascondersi quando si è nati per differenziarsi dagli altri.', '2017-11-13', 'Released', 20000000, 305937718, 991356, NULL),
(411088, 'Contrattempo', 'Contratiempo', 107, '/jeDX0eAYbDsAP0hTuGrhZQWjoGW.jpg', 'Dopo essersi svegliato a fianco del cadavere dell\'amante, un giovane uomo d\'affari ingaggia un\'avvocatessa per capire in che modo è finito tra gli indagati di omicidio.', '2017-01-06', 'Released', 4000000, 30000000, NULL, NULL),
(424694, 'Bohemian Rhapsody', 'Bohemian Rhapsody', 134, '/guQaXtD3hyCqAkX9AdjPALlaR1A.jpg', 'Bohemian Rhapsody, il film diretto da Bryan Singer e Dexter Fletcher, è una coinvolgente celebrazione dei Queen, della loro musica e del loro leggendario frontman Freddie Mercury, che sfidò gli stereotipi e infranse le convenzioni, diventando uno degli artisti più amati al mondo. Il film ricostruisce la meteorica ascesa della band attraverso le sue iconiche canzoni e il suo sound rivoluzionario, la sua crisi quasi fatale, man mano che lo stile di vita vita di Mercury andava fuori controllo, e la sua trionfante reunion alla vigilia del Live Aid, quando Mercury, afflitto da una gravissima malattia, condusse la band in una delle performance più grandiose della storia del rock. Facendo questo, il film cementa l\'eredità di una band che è sempre stata più di una famiglia e che continua ancora oggi a ispirare gli outsider, i sognatori e gli appassionati di musica.', '2018-10-24', 'Released', 52000000, 894027543, NULL, NULL),
(429617, 'Spider-Man: Far from Home', 'Spider-Man: Far from Home', 129, '/ixiDdnruGDLL63xksAebdYod3d1.jpg', 'Peter Parker ritorna in Spider-Man: Far From Home, il secondo capitolo della serie di Spider-Man: Homecoming! Il nostro amichevole Spider-Man di quartiere decide di partire per una vacanza in Europa con i suoi migliori amici. I propositi di Peter di non indossare i panni del supereroe per alcune settimane vengono meno quando decide, a malincuore, di aiutare Nick Fury a svelare il mistero degli attacchi di creature elementali che stanno creando scompiglio in tutto il continente.  Parte delle riprese sono state realizzate a Venezia tra settembre e ottobre 2018.', '2019-06-28', 'Released', 160000000, 1131927996, 531241, NULL),
(438695, 'Sing 2 - Sempre più forte', 'Sing 2', 112, '/tyuZo3ZgtNszmN0HTx8dLTQbs46.jpg', 'Buster e il suo cast hanno trasformato il New Moon Theater in un successo locale, ma Buster ha messo gli occhi su un premio più grande: Debuttare con un nuovo spettacolo al Crystal Tower Theater nell’affascinante Redshore City. Ma senza conoscenze, Buster e i suoi devono intrufolarsi negli uffici di fama mondiale Crystal Entertainment, gestiti da un lupo magnate e spietato di nome Jimmy Crystal. In un disperato tentativo di ottenere l’attenzione di Mr. Crystal, Gunter lancia spontaneamente un’idea che Buster accetta con facilità, promettendo che nel loro nuovo spettacolo ci sarà la leggenda del leone rock Clay Calloway. Il problema è che Buster non ha mai incontrato Clay, artista che si è allontanato dal mondo più di dieci anni fa e dopo la perdita di sua moglie. Mentre Gunter aiuta Buster a sognare un capolavoro teatrale, e la pressione (e le minacce sinistre) di Mr. Crystal Mount, Buster intraprende una ricerca per trovare Clay e convincerlo a tornare sul palco.', '2021-12-01', 'Released', 85000000, 406000000, 544670, NULL),
(449176, 'Tuo, Simon', 'Love, Simon', 109, '/sehXVCoR9cZ13x1NFf9bmBFgQVe.jpg', 'Tutti meritano una grande storia. Ma per Simon, è complicato: non solo perché sono gli anni del liceo, ma anche perché custodisce un segreto che non sa come rivelare agli amici e alla famiglia. Per farlo e affrontare la paura, avrà bisogno di tutto il suo coraggio (e della sua ironia).', '2018-02-16', 'Released', 17000000, 66316289, NULL, NULL),
(475557, 'Joker', 'Joker', 122, '/y1AthYH1r2j4N4cYn2HdrEGgrnJ.jpg', 'Arthur Fleck vive con l\'anziana madre in un palazzone fatiscente e sbarca il lunario facendo pubblicità per la strada travestito da clown, in attesa di avere il giusto materiale per realizzare il desiderio di fare il comico. La sua vita, però, è una tragedia: ignorato, calpestato, bullizzato, preso in giro da da chiunque, ha sviluppato un tic nervoso che lo fa ridere a sproposito incontrollabilmente, rendendolo inquietante e allontanando ulteriormente da lui ogni possibile relazione sociale. Ma un giorno Arthur non ce la fa più e reagisce violentemente, pistola alla mano. Mentre la polizia di Gotham City dà la caccia al clown killer, la popolazione lo elegge a eroe metropolitano, simbolo della rivolta degli oppressi contro l\'arroganza dei ricchi.', '2019-10-01', 'Released', 55000000, 1074251311, 987044, NULL),
(490132, 'Green Book', 'Green Book', 130, '/gyjBcyimXedn0GANgagmfmcNU44.jpg', 'Nel 1962, dopo la chiusura di uno dei migliori club di New York in cui lavorava, il buttafuori italoamericano Tony Lip deve a tutti i costi trovare un lavoro per mantenere la sua famiglia. Accetta di lavorare per il pianista afroamericano Don Shirley e decide di seguirlo in tour nel sud degli Stati Uniti. Nonostante le differenze e gli iniziali contrasti, tra i due si instaurerà una forte amicizia.', '2018-11-16', 'Released', 23000000, 319700000, NULL, NULL),
(496243, 'Parasite', '기생충', 132, '/dJFTwh20N23ZeSDIaCkOZTNoGn1.jpg', 'Tutta la famiglia di Ki-taek è senza lavoro. Ki-taek è particolarmente interessata allo stile di vita della ricchissima famiglia Park. Un giorno, suo figlio riesce a farsi assumere dai Park e le due famiglie si ritrovano così intrecciate da una serie di eventi incontrollabili.', '2019-05-30', 'Released', 11363000, 257591776, NULL, NULL),
(501170, 'Doctor Sleep', 'Doctor Sleep', 153, '/h7nrJcb0CYusDPCPdbW4ul8HSo2.jpg', 'Ancora irrimediabilmente segnato dal trauma che ha vissuto da bambino all’Overlook, Dan Torrance ha combattuto per trovare una parvenza di pace. Ma questa tregua va in frantumi quando incontra Abra, un’adolescente coraggiosa con un potente dono extrasensoriale, noto come la “luccicanza”. Riconoscendo istintivamente che Dan condivide il suo potere, Abra lo contatta, invocando disperatamente il suo aiuto contro la spietata Rose the Hat e i suoi seguaci, i membri del ‘True Knot’, che si nutrono della Luccicanza degli innocenti alla ricerca della loro immortalità. Formando un’improbabile alleanza, Dan e Abra si impegnano in una brutale lotta tra la vita e la morte contro Rose the Hat. L’innocenza di Abra e l’intrepida consapevolezza della sua Luccicanza costringono Dan a invocare i suoi stessi poteri come mai prima d’ora – affrontando immediatamente le sue paure e risvegliando i suoi fantasmi del passato.', '2019-10-30', 'Released', 45000000, 72281712, 530064, NULL),
(508442, 'Soul', 'Soul', 100, '/AcGqIA7Xns6NpK3e8zORP8iUTLa.jpg', 'Joe Gardner, direttore di una banda musicale delle scuole medie appassionato di jazz, sogna da sempre di suonare all’Half Note, un prestigioso locale di New York. Improvvisamente, dopo 20 anni di tentativi, finalmente riesce a ottenere una serata. Tuttavia uscendo in strada finisce in un tombino e muore. La sua anima si separa dal corpo e va nell’aldilà.  La storia parte da questo colpo di scena, ed è ambientata nello You Seminar, un luogo dove le anime vengono addestrate ed educate per renderci ciò che siamo: una volta pronte, si “laureano”. Joe è una delle nuove anime, e fa amicizia con 22, che pensa che la Terra faccia schifo e viene bocciata da centinaia di anni. Insieme, scopriranno cosa significa avere un’anima.', '2020-12-25', 'Released', 150000000, 136384442, NULL, NULL),
(508965, 'Klaus - I segreti del Natale', 'Klaus', 97, '/3dZ53GttlLPmCIHjlZbEvlwHYYn.jpg', 'Jesper, il peggior studente dell\'Accademia delle Poste, viene spedito su un\'isola ghiacciata, oltre il Circolo Polare Artico, dove la gente del posto fatica a scambiare qualche parola e tanto meno lettere. Jesper sta per arrendersi quando trova un\'alleata in Alva, un\'insegnante del posto, e incontra Klaus, un misterioso falegname che vive da solo in una baita piena di giocattoli realizzati a mano.', '2019-11-08', 'Released', 0, 0, NULL, NULL),
(515001, 'Jojo Rabbit', 'Jojo Rabbit', 108, '/2vv0tEFH10YG3hMRCOhiWsw7bOk.jpg', 'Jojo, un bambino cresciuto dalla sola madre, ha come unico alleato il suo amico immaginario Adolf Hitler. Il suo ingenuo patriottismo viene però messo alla prova quando incontra una ragazzina che stravolge le sue convinzioni sul mondo, costringendolo ad affrontare le sue paure più grandi.', '2019-10-18', 'Released', 14000000, 82468705, NULL, NULL),
(522402, 'Finch', 'Finch', 115, '/ci74Wvy9dJlZBISk7YieOR2p3D8.jpg', 'Finch è un uomo che intraprende un viaggio intenso e toccante in un mondo pericoloso e in preda alla devastazione, per trovare una nuova casa alla sua improbabile famiglia: l’amatissimo cane e il robot che ha appena finito di costruire.', '2021-11-04', 'Released', 2500000, 0, NULL, NULL),
(527641, 'A un metro da te', 'Five Feet Apart', 116, '/nuIlrl1jBwvKSOjXGqba418nwWF.jpg', 'Stella, diciassettenne, trascorre la maggior parte del tempo in ospedale perché affetta da fibrosi cistica. La sua vita è piena di routine, confini e autocontrollo: tutti sono messi alla prova quando incontra Will, un adolescente incredibilmente affascinante che ha la sua stessa malattia.', '2019-03-14', 'Released', 7000000, 91500000, NULL, NULL),
(569094, 'Spider-Man: Across the Spider-Verse', 'Spider-Man: Across the Spider-Verse', 0, '/7g4J08JRBGsYr7N7OYPMYYMKIbG.jpg', '', '2023-05-31', 'In Production', 0, 0, 573436, NULL),
(600354, 'The Father - Nulla è come sembra', 'The Father', 97, '/kunHAeFFHjvAxho1i7dGIBuWmU9.jpg', 'Tra le vie residenziali della Londra benestante, Anne si reca a far visita al padre Anthony nel suo appartamento. L\'uomo, ottantenne, è rammaricato quando la figlia gli annuncia un prossimo trasferimento a Parigi per raggiungere l\'uomo che ama, e chiede cosa ne sarà di lui. Poco dopo, sempre in casa sua, Anthony trova un uomo seduto a leggere il giornale, il quale sostiene di essere il padrone di casa e il marito di Anne. Pur vivace e a tratti ben lucido, Anthony mostra sintomi del morbo di Alzheimer, dimenticando fatti, luoghi e persone. Nel rapporto con i suoi familiari e con la giovane badante Laura, ultima di una lunga serie, la vita di Anthony prosegue per frammenti confusi che la sua mente non riesce più a ricomporre.', '2020-12-23', 'Released', 6000000, 21029340, NULL, NULL),
(615457, 'Io sono nessuno', 'Nobody', 92, '/iECT5xNf72P7cx9LDMrEwhGYD5O.jpg', 'Hutch Mansell, padre e marito sottostimato e trascurato, è abituato a non reagire a nessuna umiliazione. Quando una notte due ladri irrompono nella sua abitazione in periferia, rifiuta di difendere se stesso o la sua famiglia, sperando di prevenire violenze maggiori. Il figlio adolescente Blake è deluso dal suo comportamento e la moglie Becca comincia ad allontanarsi maggiormente da lui. All\'indomani dell\'accaduto, la rabbia che Hutch cova esplode spingendolo a manifestare tutta la violenza di cui è capace. Si ritroverà allora a dover difendere come meglio può la sua famiglia da un pericoloso avversario e ad assicurarsi di non essere mai più sottovalutato da nessuno.', '2021-03-18', 'Released', 17000000, 61779301, NULL, NULL),
(624860, 'Matrix Resurrections', 'The Matrix Resurrections', 148, '/tiXqnZSlLpgsY38N3k4eaHiPbWu.jpg', 'Due realtà differenti caratterizzano il mondo: una rappresentata dalla vita di tutti i giorni e un\'altra nascosta e inaccessibile. Per scoprire se la sua realtà è un costrutto fisico o mentale, per conoscere veramente se stesso, Mr. Anderson dovrà scegliere di seguire ancora una volta il Bianconiglio. E se Thomas, Neo, ha imparato qualcosa è che la scelta, pur essendo un\'illusione, è ancora una volta la via d\'uscita o di ingresso in Matrix. Ovviamente, Neo sa già cosa deve fare. Ma quello che ancora non sa è che Matrix è più forte, più sicura e più pericolosa che mai. Salvato da Matrix per diventare il salvatore dell\'umanità, ancora una volta dovrà scegliere quale strada prendere.', '2021-12-16', 'Released', 190000000, 156497322, 2344, NULL),
(634649, 'Spider-Man: No Way Home', 'Spider-Man: No Way Home', 148, '/xLnZ0DB06H0MuGXcF0uhJxr6b8y.jpg', 'In seguito agli eventi di Spider-Man: Far from Home, la vita di Peter Parker viene stravolta dopo che Mysterio rivela al mondo la sua identità. Peter chiede aiuto a Stephen Strange affinché usi la magia per far scordare a tutti la sua identità. Ma l\'incantesimo non va come previsto e Peter si ritrova a dover affrontare nemici da altri universi e a scoprire cosa significa davvero essere Spider-Man.', '2021-12-15', 'Released', 200000000, 1916050941, 531241, NULL),
(635302, 'Demon Slayer - Il treno Mugen', '劇場版「鬼滅の刃」無限列車編', 117, '/kgfLM9MqLcYY7qcW4mwPM2JAU5a.jpg', 'Enmu, recentemente liberato dalle celle Muzan, si propone di attaccare un misterioso treno in movimento. Nel corso dell\'attacco, il demone consuma molti passeggeri. Tanjiro Kamado viene in soccorso, ma questo treno in movimento trasporta più di un cattivo demone da combattere.', '2020-10-16', 'Released', 15800000, 503063688, 925155, NULL),
(637920, 'Miracle in Cell No. 7', '7. Koğuştaki Mucize', 127, '/sOfUbzu6OUL5cscGODPdpHn9C1g.jpg', 'Separato dalla sua bambina, un padre con disabilità intellettiva viene incarcerato per la morte della figlia di un comandante. Dovrà dimostrare la propria innocenza.', '2019-10-10', 'Released', 0, 19289062, NULL, NULL),
(779816, 'White Bird: A Wonder Story', 'White Bird: A Wonder Story', 122, '/1BS7e6MiWlgemAwHCaRCt41Zp3x.jpg', '', NULL, 'Post Production', 0, 0, 991356, NULL),
(791373, 'Zack Snyder\'s Justice League', 'Zack Snyder\'s Justice League', 240, '/tnAuB8q5vv7Ax9UAEje5Xi4BXik.jpg', 'In Zack Snyder’s Justice League, determinato ad assicurarsi che il sacrificio finale di Superman non sia stato vano, Bruce Wayne unisce le forze con Diana Prince con lo scopo di reclutare una squadra di metaumani, al fine di proteggere il mondo da un minaccia imminente di proporzioni catastrofiche. Il compito si rivela più difficile di quanto Bruce immaginasse, poiché ogni componente deve affrontare i demoni del proprio passato, per trascendere da ciò che li ha bloccati, permettendo loro di unirsi e formare finalmente una lega di eroi senza precedenti. Finalmente insieme, Batman, Wonder Woman, Aquaman, Cyborg e Flash potrebbero essere in ritardo per salvare il pianeta da Steppenwolf, DeSaad e Darkseid e dalle loro terribili intenzioni.', '2021-03-18', 'Released', 70000000, 657900000, NULL, NULL),
(802401, 'Demon Slayer: Kimetsu no Yaiba Mt. Natagumo Arc', '鬼滅の刃 那田蜘蛛山編', 138, '/gFZ3K5tgFit6PHOXLvSRwzDWacG.jpg', '', '2020-10-17', 'Released', 0, 0, 925155, NULL),
